INSERT INTO `plan_clase` VALUES("45","[\"InstalaciÔö£Ôöén de wordpress\"]","2018-07-30","[\"Practicar el proceso de instalaciÔö£Ôöén\"]","{\"estrategia\":[\"Paso a paso\"],\"Actividad\":[\"guÔö£┬ías de estudio\"],\"Recurso\":[\"Computador\",\"wordpress\",\"XAMPP O WAMP\"]}","{\"estrategiaplanb\":[\"Paso a paso\"],\"Actividadplanb\":[\"guÔö£┬ías de estudio\"],\"Recursosplanb\":[\"XAMPP O WAMP\"]}","8","tecnico2","         Teniendo en cuenta la instrucciÔö£Ôöén brindada por el docente deben crear una guÔö£┬ía de apoyo que sirva para recordar el proceso de instalaciÔö£Ôöén.\n\nRoles de wordpress\n\nSuscriptor ->leer\n\ncolaborador->articulos con autorizaciÔö£Ôöén\n\n---\n\n   1)Carpeta Comprimida del proyecto de local\n\n2)Exportar la base de datos de local\n\n3) Ingresar a sudominio/cpanel\n\n4)Ir a administrador de archivos y subir el proyecto.zip\n\n5)Clic derecho sobre el proyecto.zip y pulso sobre extract\n\n6)Ir a administrador de base de datos \n\n	*crear base de datos con el nombre del proyecto\n\n	*Crar un usuario y clave de base de datos\n\n	*Asociar el usuario creado a la base de datos deseada\n\n	*Vamos a cpanel en la secciÔö£Ôöén de phpmyadmin y seleccionamos la base datos de nuestro proyecto\n\n	*Importamos el archivo del item 2 (proyecto.sql)\n\n7)Vamos a la carpeta que contiene nuestro proyecto y dentro encontramos un archivo llamado wp-config.php el cual debemos modificar en los siguiente criterios\n\n	*DB_USER\n\n	*DB_PASSWORD\n\n	*DB_NAME\n\nNota: No olvidar en la base de datos reemplazar en las dos primeras opciones de la tabla wp-option localhost por el nombre su dominio por ejemplo andrespaz.hst.edu.co/bella\n\n8) Ir a la direcciÔö£Ôöén de su dominio/proyecto para verificar su funcionamient\n\nautor->articulos sin  autorizaciÔö£Ôöén\n\neditor->acceso a opciones pero no totales\n\n","2","3","[\"\"]");
