INSERT INTO `plan_clase` VALUES("156","[\"anÔö£├¡lisis de datos  sql\"]","2021-06-29","[\"Aplicar\"]","{\"estrategia\":[\"Asistencia guÔö£┬íada\"],\"Actividad\":[\"Calcular el rango superior e inferior de los distintos dispositivos  para el 75% de los dÔö£┬ías \"],\"Recurso\":[\"xampp\"]}","{\"estrategiaplanb\":[\"Asistencia guÔö£┬íada\"],\"Actividadplanb\":[\"Calcular el rango superior e inferior de los distintos dispositivos  para el 75% de los dÔö£┬ías\"],\"Recursosplanb\":[\"cuaderno\"]}","48","tecnico4","<p>*Se debe importar la base de datos de carsdatamin</p>\n\n<p>* Hacer consultas generales</p>\n\n<p>* Se debe importar la base de datos carsdata volume grande&nbsp;</p>\n\n<p>* Consultar el id del del cliente que ha generado el valor mayor de compra dentro de nuestra tabla de ventas</p>\n\n<p>* Consultar el dispositivo y tiempo promedio en segundos que mantiene el cliente con un valor de compra mayor en nuestra tabla de venta</p>\n\n<p>*Luego hacer probabilidad</p>\n\n<p>SELECT dispositivo, avg(`tiempo_promedio_segundos`) as promedio FROM `sitio_web` where id_cliente=\"1\" GROUP by dispositivo</p>\n\n<p>SELECT dispositivo, std(`tiempo_promedio_segundos`) as desvstandar FROM `sitio_web` where id_cliente=\"1\" GROUP by dispositivoSELECT</p>\n\n<p>AVG(LENGTH(direccion)), max(LENGTH(direccion)),STD(LENGTH(direccion)) FROM `persona`&nbsp; (promedio, max y desviaci&oacute;n standar de cantidad que existe una persona a la hora de escribir su direcci&oacute;n)</p>\n\n<p>SELECT avg (round((DATEDIFF(NOW(),fecha_nacimiento))/360)) as promedio_edad FROM `persona`&nbsp; (promedio de edad de personas)&nbsp;</p>\n\n<p>_____________</p>\n\n<p>cambiar separador excel Haga clic en Archivo &gt; Opciones.</p>\n\n<p>En la pesta&ntilde;a Avanzadas, en Opciones de edici&oacute;n,desactive la casilla Usar separadores del sistema.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>","2","7","[]");
