INSERT INTO `plan_clase` VALUES("128","[\"Power Query\"]","2020-09-14","[\"Extraer\"]","{\"estrategia\":[\"Asistencia guÔö£┬íada\"],\"Actividad\":[\"limpiar y transformar datos \"],\"Recurso\":[\"Power Bi\",\"Saba de datos de estudiantes de colegio\"]}","{\"estrategiaplanb\":[\"\"],\"Actividadplanb\":[\"\"],\"Recursosplanb\":[\"\"]}","36","tecnico4","<p>Especificar datos: Permite crear una tabla de forma manual o de un origen de datos administrar par&aacute;metros: podemos comprenderla como variables que se usan para el archivo en uso Configuraci&oacute;n de or&iacute;genes de datos ___________ Importamos el archivo de datos y seleccionamos la tabla datos seleccionamos la opci&oacute;n de transformar datos colocamos la primera fila como encabezado en nueva consulta hacemos un ejemplo de especificar datos para mostrar como se puede importar datos de diferentes or&iacute;genes configuraci&oacute;n de or&iacute;genes de datos cambiamos el origen de datos del archivo y lo guardamos en administrar parameteros para crear una nueva variable y usarla en origentes de datos, de igual forma crear una variable llamado pulgada 39,37 para multiplicar En la secci&oacute;n de consultas, una consulta hace referencia a cada &quot;tabla&quot;, de igual forma se puede referenciar de una consulta(tabla1) cuando necesita la misma base(tabla ) para diferentes reportes es decir que si tengo una tabla1 y tengo de referencia una tabla2 elimino el campo A de la tabla 1 autom&aacute;ticamente en casada se elimina de la tabla 2 pero no sucede en sentido contrario Realizar agrupaci&oacute;n permite hacer un resumen por ejemplo balance por edad y genero del promedio de valoraciones Agrupar permite relacionar dos tablas de bases de datos Anexar consultar integra varios archivos que tengan los mismos registros en una sola tabla o consulta Anulaci&oacute;n de dinamizaci&oacute;n: Gira las las columnas se&ntilde;aladas a valores.</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p><img alt=\"Power BI Desktop: informes interactivos | Microsoft Power BI\" src=\"data:image/jpeg;base64,\" /></p>\n\n","2","6","[\"\"]");
