INSERT INTO `plan_clase` VALUES("155","[\"Texto\",\"FusiÔö£Ôöén de impresiÔö£Ôöén\"]","2021-06-28","[\"Identificar\",\"Usar\"]","{\"estrategia\":[\"Asistencia guÔö£┬íada\"],\"Actividad\":[\"Realizar cuadernillo de ejercicios (smartphone)\"],\"Recurso\":[\"Corel\"]}","{\"estrategiaplanb\":null,\"Actividadplanb\":[\"Realizar un boseto\"],\"Recursosplanb\":[\"cuaderno\"]}","13","tecnico4","<p>Se procede a verificar que el ejercicio de pacman se a completado de no ser asi debemos permitir completador y luego explicar la herramienta texto&nbsp;</p>\n\n<p>la herramienta texto (En caso de no querer visualizar el marco del texto vamos al menu texto-&gt;Marco de texto de parrafo y lo desactivamos)}</p>\n\n<p>*Barra de propiedades (Fuente,tama&ntilde;o,negrita,cursiva,)</p>\n\n<p>*Convertir a texto artistico (clic derecho,convertir a texto artistico)</p>\n\n<p>*Con la herramienta forma (segunda de barra de herramientas) podriamos separar las letras&nbsp;</p>\n\n<p>* Para m&aacute;s propiedades de texto nos vamos al menu texto-&gt;propiedades de texto y se habilita una barra en la parte derecha</p>\n\n<p>* Clic derecho convertir a curvas un texto para deformarlo en caso que se necesite&nbsp;</p>\n\n<p>* Para adaptar a trayectoria debemos convertir el texto a artistico y luego en el menu texto tenemos la opci&oacute;n de adaptar texto a trayectoria y seleccionamos la circunferencia.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>","0","13","[]");
