INSERT INTO `planeador_vallesol` VALUES("1","2024-07-30","2024-07-02","2024-07-18","6","103","3","12",". Comprende la clasificación de los materiales a partir de grupos de sustancias (elementos y compuestos) y mezclas (homog├®neas y heterog├®neas).","CLASES PRÁCTICAS : se desarrollan actividades de aplicaci├│n de los conocimientos a situaciones concretas y de adquisici├│n de habilidades b├ísicas y procedimentales relacionadas con la materia objeto de estudio. Esta denominaci├│n engloba a diversos tipos de organizaci├│n, como pueden ser las pr├ícticas de laboratorio, pr├ícticas de campo, clases de problemas, pr├ícticas de inform├ítica, etc., puesto que, aunque presentan en algunos casos matices importantes, todas ellas tienen como caracter├¡stica com├║n que su finalidad es mostrar a los estudiantes c├│mo deben actuar.","ÔÇó Diferencia sustancias puras de mezclas en ejemplos de uso cotidiano.ÔÇó Explica la relaci├│n entre la temperatura y la presi├│n con algunas propiedades (densidad, solubilidad, viscosidad, puntos de ebullici├│n y de fusi├│n) de las sustancias a partir de ejemplos.ÔÇó Dise├▒a y realiza experiencias para separar mezclas homog├®neas y heterog├®neas utilizando t├®cnicas para justificar la elecci├│n de las mismas, a partir de las propiedades fisicoqu├¡micas de las sustancias involucradas.ÔÇó Crea m├®todos y/o sistemas de separaci├│n de los residuos s├│lidos que se producen en la instituci├│n.ÔÇó Analiza los m├®todos de desecho de sustancias qu├¡micas para evitar la contaminaci├│n","Momentos de la clase:\nActivación de conocimientos previos:\nÔÇó Lluvia de ideas sobre sustancias cotidianas que los estudiantes consideren fluidos.\nÔÇó Discusi├│n guiada: ┬┐Qu├® caracter├¡sticas tienen en com├║n estas sustancias?\n Introducci├│n a los fluidos\nÔÇó Definici├│n colaborativa de fluido a partir de las observaciones previas.\nÔÇó Breve explicaci├│n del docente sobre las caracter├¡sticas generales de los fluidos.\nb) Conceptos de soluciones \nÔÇó Actividad pr├íctica en parejas: Disolver sal en agua y az├║car en agua.\nÔÇó Introducci├│n dial├│gica de los conceptos de soluto y solvente.\nÔÇó Discusi├│n grupal: ┬┐Qu├® papel juega cada sustancia en la mezcla?\nc) Propiedades de las soluciones\nÔÇó Divisi├│n de la clase en grupos peque├▒os.\nÔÇó Cada grupo investiga una propiedad espec├¡fica de las soluciones (concentraci├│n, solubilidad, conductividad, punto de ebullici├│n, punto de congelaci├│n).\nÔÇó Realizaci├│n de mini-experimentos para demostrar cada propiedad.\nÔÇó Presentaci├│n breve de cada grupo sobre su propiedad asignada.\n\nValoraci├│n: \nActividad de aplicaci├│n:\nÔÇó Los estudiantes desarrollan en una hoja cuales son sus reacciones y conclusiones a las evidencias que obtienen luego de las experimentaciones relacionadas con los conceptos que van aprendiendo en cuanto a solubilidad \n-  Los estudiantes desarrollan un taller en el que fijan conceptos por medio de herramientas como sopas de letras que les permiten la fijaci├│n de conceptos \n\nDiscusi├│n guiada:\nÔÇó ┬┐C├│mo se relacionan estos conceptos con nuestra vida diaria?\nÔÇó ┬┐Qu├® ejemplos de soluciones podemos encontrar en casa o en la naturaleza?\n\nGu├¡as de acompa├▒amiento: https://mailudesedu-my.sharepoint.com/:f:/g/personal/01240100237_mail_udes_edu_co/EqJrXojiU-NBoF1YttqB494B9eG60QhMKhf2d41ceqnF3g?e=r49JYn\n","Cuaderno, Agua, Aceite, Azucar, Sal , Detergente","La reflexión de la práctica y experimental por parte de los estudiantes es fundamental para la comprensión y fijación del conocimiento de los estudiantes","Comprender la clasificaci├│n de los materiales a partir de grupos de sustancias","ÔÇó	Elemento, compuestos y mezclas\n\nÔÇó	Solubilidad \nÔÇó	Viscosidad\nÔÇó	Densidad\nÔÇó	Punto de ebullici├│n\nÔÇó	Punto de fusi├│n  \nÔÇó	Tipos de mezclas homog├®neas y heterog├®neas\nÔÇó	M├®todos de separaci├│n de mezclas.\n");
INSERT INTO `planeador_vallesol` VALUES("2","2024-07-30","2024-07-23","2024-07-31","6","103","3","6",". Comprende la clasificaci├│n de los materiales a partir de grupos de sustancias (elementos y compuestos) y mezclas (homog├®neas y heterog├®neas). ","Trabajo en grupo : Orientaci├│n de los docentes a los grupos para que llas preguntas, reflexiones para el conocimiento sea conjunto","ÔÇó	Diferencia sustancias puras de mezclas en ejemplos de uso cotidiano.ÔÇó	Explica la relaci├│n entre la temperatura y la presi├│n con algunas propiedades (densidad, solubilidad, viscosidad, puntos de ebullici├│n y de fusi├│n) de las sustancias a partir de ejemplos.ÔÇó	Dise├▒a y realiza experiencias para separar mezclas homog├®neas y heterog├®neas utilizando t├®cnicas para justificar la elecci├│n de las mismas, a partir de las propiedades fisicoqu├¡micas de las sustancias involucradas.ÔÇó	Crea m├®todos y/o sistemas de separaci├│n de los residuos s├│lidos que se producen en la instituci├│n.ÔÇó	Analiza los m├®todos de desecho de sustancias qu├¡micas para evitar la contaminaci├│n","Activaci├│n de conocimientos previos mediante una lluvia de ideas sobre fluidos cotidianos.INSERT INTO `planeador_vallesol` VALUES("3","2024-07-30","2024-07-08","2024-07-08","10","104","3","2"," aplica los principios cient├¡ficos para analizar fen├│menos, resolver problemas y tomar decisiones informadas.","Trabajo en grupo : Orientaci├│n de los docentes a los grupos para que llas preguntas, reflexiones para el conocimiento sea conjunto","Los estudiantes elaboran modelos, diagramas y gr├íficos para representar conceptos cient├¡ficos. *Los estudiantes participan en debates y discusiones cient├¡ficas para defender sus ideas y evaluar las ideas de los dem├ís","Inicio\nLa clase comienza con una activaci├│n din├ímica de conocimientos previos mediante una discusi├│n guiada sobre la electricidad y sus manifestaciones en la vida cotidiana. El docente facilita un di├ílogo abierto, animando a los estudiantes a compartir ejemplos de c├│mo interact├║an con la electricidad en su d├¡a a d├¡a, desde el uso de smartphones hasta electrodom├®sticos.\nPosteriormente, se realiza una demostraci├│n presentando una simulaci├│n de un circuito simple compuesto por una pila, cables y una bombilla. El docente enciende la bombilla y plantea preguntas provocativas para estimular el pensamiento cr├¡tico: ┬┐Qu├® fen├│meno f├¡sico hace que la bombilla se encienda? ┬┐Qu├® componentes del circuito creen que son esenciales para su funcionamiento? ┬┐Qu├® factores podr├¡an influir en el brillo de la bombilla?\nSe anima a los estudiantes a formular hip├│tesis y a argumentar sus respuestas, fomentando un ambiente de curiosidad cient├¡fica y respeto por las ideas de los dem├ís. El docente gu├¡a la discusi├│n hacia los conceptos de energ├¡a el├®ctrica, flujo de electrones y resistencia, preparando el terreno para la introducci├│n de la Ley de Ohm.\nDesarrollo \nEn esta fase, se introduce de manera dial├│gica los conceptos fundamentales de voltaje, corriente y resistencia. El docente utiliza analog├¡as cotidianas para facilitar la comprensi├│n, como comparar el flujo de electrones con el agua en una manguera, donde la presi├│n del agua ser├¡a an├íloga al voltaje y el caudal a la corriente el├®ctrica.\nSe procede a una demostraci├│n de la Ley de Ohm . Los estudiantes observan c├│mo los cambios en el voltaje o la resistencia afectan la corriente en el circuito. Se les anima a predecir resultados antes de cada medici├│n, promoviendo el pensamiento cient├¡fico.\nLa clase se divide en grupos peque├▒os para la tarea de desarrollar circuitos simples, variando sistem├íticamente el voltaje y la resistencia, y midiendo la corriente resultante. Los estudiantes registran sus observaciones en una tabla de datos.\nBas├índose en los datos recopilados, la clase colabora en la construcci├│n de la f├│rmula de la Ley de Ohm. El docente gu├¡a este proceso de descubrimiento, ayudando a los estudiantes a identificar patrones.\nSe dedica tiempo a la resoluci├│n guiada de problemas pr├ícticos aplicando la Ley de Ohm. Los estudiantes trabajan en parejas, discutiendo estrategias de resoluci├│n y compartiendo sus enfoques con la clase.\nLa sesi├│n concluye con una discusi├│n en grupos sobre las aplicaciones de la Ley de Ohm en dispositivos cotidianos, desde cargadores de tel├®fonos hasta sistemas de iluminaci├│n dom├®stica.\nEvaluaci├│n\nPara evaluar la comprensi├│n y aplicaci├│n de los conceptos aprendidos, se plantea un taller con m├║ltiples ejercicios que abordan diferentes aspectos de la Ley de Ohm. El taller incluye:\nProblemas de c├ílculo directo donde los estudiantes deben encontrar el voltaje, la resistencia o la corriente, dados los otros dos valores.\nEjercicios de an├ílisis de circuitos simples, donde deben determinar c├│mo cambios en un componente afectan a los dem├ís.\nProblemas contextualizados en situaciones reales, como calcular la resistencia necesaria para un LED en un proyecto de electr├│nica.\nPreguntas de razonamiento que requieren explicar el comportamiento de circuitos bajo diferentes condiciones.\n\nLos estudiantes trabajan individualmente en el taller, pero se les permite consultar con sus compa├▒eros si encuentran dificultades. El docente circula por el aula, ofreciendo orientaci├│n y aclarando dudas cuando sea necesario.\nAl finalizar, se realiza una revisi├│n colectiva de algunos problemas seleccionados, promoviendo la discusi├│n sobre diferentes enfoques de resoluci├│n y reforzando los conceptos clave.\nEsta estructura de clase fomenta un aprendizaje activo y participativo, integrando teor├¡a y pr├íctica de manera efectiva, y proporcionando m├║ltiples oportunidades para la aplicaci├│n y evaluaci├│n del conocimiento adquirido.\n\n\n\n","Gu├¡a de trabajo","La relaci├│n en fisica de algunas tematicas es de mayor atracci├│n para algunos estudiantes que para otros , se busca formas de mejroar la motivaci├│n","","*Electricidad * Circuito electricos serie * circuitos electricos paralelo");
