trata entonces de aprender haciendo, desarrollando habilidades donde los conocimientos se adquieren a trav├®s de una pr├íctica concreta; ejecutando algo relacionado con el objetivo que se pretende alcanzar, en  un contexto particular de aprendizaje. Es una metodolog├¡a participativa en la que se ense├▒a y se aprende a trav├®s de una tarea conjunta. Su metodolog├¡a descansa en la actividad del estudiante y en la organizaci├│n basada en peque├▒os grupos. La utilizaci├│n de este m├®todo tiene como cometido dar respuesta a preguntas planteadas en las consignas de trabajo, teniendo en cuenta la opini├│n de todos los miembros del grupo, para llegar a una toma de decisiones colectiva. Desarrollando el taller en  la pr├íctica de conocimientos para despertar el inter├®s en los","ÔÇó	Crea accesos directos diferenciando entre carpetas, archivos, discos y programas en el S.O.ÔÇó	Utiliza el panel de control para personalizar el ambiente de trabajo del sistema operativo Windows. ÔÇó	Utiliza las herramientas de Scandisk y desfragmentador de disco para solucionar problemas del sistema operativo.ÔÇó	Participa en jornadas de recolecci├│n y separaci├│n de residuos s├│lidos y elementos tecnol├│gicos en desuso. (Prae)","Presentaci├│n del tema y activaci├│n de conocimientos previos a trav├®s de una lluvia de ideas sobre las funciones b├ísicas de Windows.INSERT INTO `planeador_vallesol` VALUES("23","2024-08-20","2024-08-20","2024-08-20","6","113","3","1","Act├║a basada en principios y valores sociales conservados en los grupos donde interact├║a.","El Aprendizaje Cooperativo es una estrategia pedag├│gica donde los estudiantes trabajan juntos en peque├▒os grupos para maximizar su propio aprendizaje y el de los dem├ís. Esta metodolog├¡a se alinea perfectamente con el enfoque dial├│gico, ya que fomenta la interacci├│n, el intercambio de ideas y la construcci├│n colectiva del conocimiento.","Identifico la importancia de los valores humanos. Conoce los beneficios de una persona comprometida en el bienestar de todos. Describe como la persona aplica los derechos y deberes para convivir en paz. Identifica las ventajas cuando se conocen y aplican los valores humanos. Opino sobre los problemas de convivencia y propongo soluciones","Din├ímica Inicial: Comienza con una actividad de c├¡rculo de la confianza, donde los estudiantes, sentados en un c├¡rculo, comparten brevemente una situaci├│n de conflicto que hayan vivido o presenciado. Utiliza preguntas guiadoras como:INSERT INTO `planeador_vallesol` VALUES("24","2024-08-20","2024-08-21","2024-08-21","11","114","3","1","Identifico las acciones que actu├│ en contra de los derechos de otras personas y comprendo por qu├® esas acciones vulneran sus derechos","El Aprendizaje Cooperativo es una estrategia pedag├│gica donde los estudiantes trabajan juntos en peque├▒os grupos para maximizar su propio aprendizaje y el de los dem├ís. Esta metodolog├¡a se alinea perfectamente con el enfoque dial├│gico, ya que fomenta la interacci├│n, el intercambio de ideas y la construcci├│n colectiva del conocimiento.","Comprende que la escuela y las instituciones p├║blicas y privadas promueven los derechos humanos. Identifica lo valioso de la riqueza cultural y natural de la naci├│n. Valora el talento humano que genera cambios y progreso.","Din├ímica Inicial: Comienza con una actividad de c├¡rculo de la confianza, donde los estudiantes, sentados en un c├¡rculo, comparten brevemente una situaci├│n de conflicto que hayan vivido o presenciado. Utiliza preguntas guiadoras como: ┬┐Qu├® sentiste en ese momento? ┬┐C├│mo reaccionaron las personas involucradas? ┬┐Qu├® impacto tuvo en ti y en los dem├ís? Presentaci├│n del Tema: Se introduce el concepto de resoluci├│n de conflictos, explicando sus etapas y estrategias clave (por ejemplo, la escucha activa, la empat├¡a, la negociaci├│n y la mediaci├│n). Se usa ejemplos reales o simulaciones breves para ilustrar cada etapa. Din├ímicas de Cambio de Roles: Organiza a los estudiantes en peque├▒os grupos y dales escenarios de conflicto que podr├¡an ser relevantes para su vida diaria (como desacuerdos entre amigos, problemas en el aula, etc.). Actividad: Cada grupo asignar├í roles (mediador, partes en conflicto, observadores) y ensayar├í la resoluci├│n del conflicto utilizando las t├®cnicas aprendidas. Taller Escrito: Proporciona un caso de estudio detallado de un conflicto que requiera resoluci├│n. Actividad: Los estudiantes, de forma individual o en pares, analizar├ín el caso, identificar├ín los puntos clave del conflicto, y propondr├ín una serie de soluciones aplicando las estrategias discutidas en clase. Evaluaci├│n: Los trabajos ser├ín evaluados no solo por las soluciones propuestas, sino tambi├®n por la comprensi├│n demostrada de las etapas de resoluci├│n de conflictos y la aplicaci├│n de los principios de paz","Tarjetas y bol├¡grafos para la actividad de compromiso. Casos de estudio impresos para el taller.		","Los estudiantes pueden compartir voluntariamente su compromiso, reforzando el sentido de comunidad y responsabilidad colectiva.","identificar y aplicar estrategias de negociaci├│n y resoluci├│n de conflictos en su vida cotidiana	","UNIDAD 3. TIPOLOGIA DEL CONFLICTO. 3.1. Superaci├│n del conflicto 3.2. Tipos de conflictos 3.3. Como combatir estereotipos 3.4. Valoraci├│n de conflictos");
INSERT INTO `planeador_vallesol` VALUES("25","2024-08-26","2024-08-26","2024-08-26","6","103","3","1","ÔÇó	Identifica los tipos de danza de las distintas regiones de Colombia, lo mismo que el vestuario y costumbres.ÔÇó	Asume una actitud participativa en las diversas actividades grupales","Trabajo en grupo : Orientaci├│n de los docentes a los grupos para que llas preguntas, reflexiones para el conocimiento sea conjunto","ÔÇó	Interpreta algunos ritmos de folclore colombiano.ÔÇó	Elabora vestuario pertinente con los elementos del medio-ÔÇó	Demuestra inter├®s, placer, goce y disfrute al observar los aportes l├║dicos propios y de los dem├ís.","Inicio: INSERT INTO `planeador_vallesol` VALUES("26","2024-08-26","2024-08-26","2024-08-26","11","106","3","1","ÔÇó	Controla, orienta y ensaya nuevas habilidades corporales que le permitan, con relativa facilidad, la ejecuci├│n de pasos y esquemas expresivos.ÔÇó	Describe, compara y explica de manera oral o escrita concepciones de su imaginario fant├ístico y de las danzas del pasado y contempor├ínea.ÔÇó	Manifiesta inter├®s, identifica y maneja los movimientos b├ísicos de las danzas que produce, las danzas de su comunidad y las del entorno en general.","Trabajo en grupo : Orientaci├│n de los docentes a los grupos para que llas preguntas, reflexiones para el conocimiento sea conjunto","ÔÇó	Muestra que conoce y valora su entorno cultural en actividades te├│ricas o pr├ícticas de ├¡ndole investigativa a trav├®s de consultas.ÔÇó	Se involucra gustoso en actividades grupales que acrecientan su aprecio por el patrimonio cultural.ÔÇó	Es consciente de la posici├│n y el movimiento de su cuerpo y del espacio en la cotidianidad y en las expresiones art├¡sticas.ÔÇó	Produce peque├▒as propuestas de movimientos y danza de diferente ├¡ndole, en torno al mundo sonoro, musical y pl├ístico que denotan que escucha y observa con relaci├│n al medio ambiente.","Inicio: INSERT INTO `planeador_vallesol` VALUES("27","2024-08-26","2024-08-08","2024-08-08","6","103","3","2","┬À┬á┬á┬á┬á┬á┬á┬á 1. Comprende que el movimiento de un cuerpo, en un marco de referencia inercial dado, se puede describir con gr├íficos y predecir por medio de expresiones matem├íticas.","Ense├▒anza directa : En ella el profesor gu├¡a la pr├íctica de los alumnos","ÔÇó	Describe el movimiento de un cuerpo (rectil├¡neo uniforme y uniformemente acelerado, en dos dimensiones -circular uniforme y parab├│lico) en gr├íficos que relacionan el desplazamiento, la velocidad y la aceleraci├│n en funci├│n del tiempo.ÔÇó	Predice el movimiento de un cuerpo a partir de las expresiones matem├íticas con las que se relaciona, seg├║n el caso, la distancia recorrida, la velocidad y la aceleraci├│n en funci├│n del tiempo.ÔÇó	Analizar los puntos de reciclaje que se encuentren m├ís cercanos a la instituci├│n para predecir distancia, sentido y direcci├│n mediante el uso de los vectores","Motivaci├│n: Inicia la clase con una pregunta o una situaci├│n cotidiana que involucre energ├¡a: ┬┐Alguna vez te has preguntado por qu├® la luz enciende cuando presionas un interruptor? ┬┐De d├│nde viene el calor que sentimos cuando hacemos ejercicio?\nPreconceptos: Realiza una lluvia de ideas con los estudiantes sobre qu├® saben sobre la energ├¡a. Anota sus respuestas en el pizarr├│n para luego retomarlas al final de la clase.\nPresentaci├│n del tema: Explica de manera sencilla qu├® es la energ├¡a y su importancia en nuestra vida diaria. Utiliza ejemplos cotidianos para que los estudiantes comprendan el concepto y se emplea la gu├¡a de aprendizaje.\nTipos de energ├¡a: Presenta los principales tipos de energ├¡a de forma visual y sencilla, utilizando im├ígenes y ejemplos concretos:\nEnerg├¡a mec├ínica: Relacionada con el movimiento (ej: una pelota rodando, un autom├│vil en movimiento).\nEnerg├¡a t├®rmica: Relacionada con el calor (ej: el sol, una estufa).\nEnerg├¡a luminosa: Relacionada con la luz (ej: el sol, una bombilla).\nEnerg├¡a sonora: Relacionada con el sonido (ej: una guitarra, un trueno).\nEnerg├¡a el├®ctrica: Relacionada con la electricidad (ej: una bater├¡a, una toma de corriente).\n\nActividades:\nExperimento: Realiza un experimento sencillo para mostrar la transformaci├│n de energ├¡a, como frotar un globo contra el cabello y pegarlo a la pared (energ├¡a mec├ínica en energ├¡a el├®ctrica). y un taller te├│rico para fortalecer los conceptos principales","     tv, cuaderno","La ense├▒anza de las ciencias naturales, y en particular de la energ├¡a, representa un desaf├¡o apasionante","Comprender qu├® es la energ├¡a y sus diferentes formas de manifestaci├│n.","ÔÇó	HerenciaÔÇó	El ADN ÔÇó	Transcripci├│n, traducci├│n y sintesis de prote├¡nas ÔÇó	Las leyes de MendelÔÇó	FenotipoÔÇó	GenotipoÔÇó	Enfermedades gen├®ticas y mutaciones");
INSERT INTO `planeador_vallesol` VALUES("28","2024-08-26","2024-08-26","2024-08-26","10","104","3","","aplica los principios cient├¡ficos para analizar fen├│menos, resolver problemas y tomar decisiones informadas.","DISCUSI├ôN DIRIGIDA : Consiste en discutir un tema, bajo la direcci├│n del educador. Su principal uso consiste en dirigir el di├ílogo mediante preguntas espec├¡ficas hacia un objetivo com├║n. Despu├®s de la discusi├│n se aceptar├ín las conclusiones  de la mayor├¡a por medio de un trabajo de colaboraci├│n intelectual. Lo anterior permite","Los estudiantes elaboran modelos, diagramas y gr├íficos para representar conceptos cient├¡ficos. *Los estudiantes participan en debates y discusiones cient├¡ficas para defender sus ideas y evaluar las ideas de los dem├ís","Revisi├│n de conceptos previos: Iniciar con una breve revisi├│n de los tipos b├ísicos de energ├¡a (cin├®tica, potencial, t├®rmica, el├®ctrica, etc.) y sus transformaciones, vistos en cursos anteriores.\nPresentar un fen├│meno f├¡sico complejo (por ejemplo, la generaci├│n de energ├¡a nuclear o el funcionamiento de un panel solar) y se pide a los estudiantes que formulen hip├│tesis sobre los procesos energ├®ticos involucrados.\nDesarrollo:\nConservaci├│n de la energ├¡a:\nExplicar el principio de conservaci├│n de la energ├¡a a trav├®s de ejemplos cotidianos .\nEficiencia energ├®tica:\nDefinir eficiencia energ├®tica y su importancia.\nAnalizar diferentes dispositivos y procesos desde el punto de vista de la eficiencia.\nRealizar c├ílculos de eficiencia utilizando datos reales.\nFuentes de energ├¡a:\nClasificar las fuentes de energ├¡a en renovables y no renovables.\nAnalizar las ventajas y desventajas de cada tipo de fuente, incluyendo su impacto ambiental y econ├│mico.\nDiscutir sobre el futuro de la energ├¡a y las tendencias actuales\nActividad:\nSe desarrolla una actividad que contiene preguntas que busca reforzar conceptos y argumentar la importancia de un uso adecuado de la energ├¡a","Cuaderno ","Esta propuesta busca no solo transmitir conocimientos sobre los diferentes tipos de energ├¡a y sus transformaciones, sino tambi├®n desarrollar habilidades de pensamiento cr├¡tico,","Desarrollar la comprensi├│n del ciclo energ├®tico, ","Movimiento parabolico, ley de ohm,");
INSERT INTO `planeador_vallesol` VALUES("29","2024-09-01","2024-08-05","2024-08-05","6","103","3","2","Comprende la clasificaci├│n de los materiales a partir de grupos de sustancias (elementos y compuestos) y mezclas (homog├®neas y heterog├®neas).","DISCUSI├ôN DIRIGIDA : Consiste en discutir un tema, bajo la direcci├│n del educador. Su principal uso consiste en dirigir el di├ílogo mediante preguntas espec├¡ficas hacia un objetivo com├║n. Despu├®s de la discusi├│n se aceptar├ín las conclusiones  de la mayor├¡a por medio de un trabajo de colaboraci├│n intelectual. Lo anterior permite","ÔÇó	Describe el movimiento de un cuerpo (rectil├¡neo uniforme y uniformemente acelerado, en dos dimensiones -circular uniforme y parab├│lico) en gr├íficos que relacionan el desplazamiento, la velocidad y la aceleraci├│n en funci├│n del tiempo.ÔÇó	Predice el movimiento de un cuerpo a partir de las expresiones matem├íticas con las que se relaciona, seg├║n el caso, la distancia recorrida, la velocidad y la aceleraci├│n en funci├│n del tiempo.ÔÇó	Analizar los puntos de reciclaje que se encuentren m├ís cercanos a la instituci├│n para predecir distancia, sentido y direcci├│n mediante el uso de los vectores","Momentos de la clase:INSERT INTO `planeador_vallesol` VALUES("31","2024-09-04","2024-08-15","2024-08-15","6","103","3","2",". Comprende la clasificaci├│n de los materiales a partir de grupos de sustancias (elementos y compuestos) y mezclas (homog├®neas y heterog├®neas).","Aprendizaje por Descubrimiento : Se motiva a los estudiantes a explorar, experimentar y descubrir por s├¡ mismos conceptos y principios.","ÔÇó	Diferencia sustancias puras de mezclas en ejemplos de uso cotidiano.ÔÇó	Explica la relaci├│n entre la temperatura y la presi├│n con algunas propiedades (densidad, solubilidad, viscosidad, puntos de ebullici├│n y de fusi├│n) de las sustancias a partir de ejemplos.ÔÇó	Dise├▒a y realiza experiencias para separar mezclas homog├®neas y heterog├®neas utilizando t├®cnicas para justificar la elecci├│n de las mismas, a partir de las propiedades fisicoqu├¡micas de las sustancias involucradas.ÔÇó	Crea m├®todos y/o sistemas de separaci├│n de los residuos s├│lidos que se producen en la instituci├│n.ÔÇó	Analiza los m├®todos de desecho de sustancias qu├¡micas para evitar la contaminaci├│n","Activaci├│n de conocimientos previos mediante una lluvia de ideas sobre las caracter├¡sticas de los l├¡quidos y s├│lidos.INSERT INTO `planeador_vallesol` VALUES("32","2024-09-04","2024-08-22","2024-08-22","6","103","3","2",". Comprende la clasificaci├│n de los materiales a partir de grupos de sustancias (elementos y compuestos) y mezclas (homog├®neas y heterog├®neas).","TALLER : Implica como su nombre lo dice, un lugar donde se trabaja y labora. Es una forma de ense├▒ar y aprender mediante la realizaci├│n de algo, es decir aprender haciendo. En esta estrategia predomina y se privilegia, el aprendizaje sobre la ense├▒anza. Se trata entonces de aprender haciendo, desarrollando habilidades donde los conocimientos se adquieren a trav├®s de una pr├íctica concreta; ejecutando algo relacionado con el objetivo que se pretende alcanzar..","ÔÇó	Diferencia sustancias puras de mezclas en ejemplos de uso cotidiano.ÔÇó	Explica la relaci├│n entre la temperatura y la presi├│n con algunas propiedades (densidad, solubilidad, viscosidad, puntos de ebullici├│n y de fusi├│n) de las sustancias a partir de ejemplos.ÔÇó	Dise├▒a y realiza experiencias para separar mezclas homog├®neas y heterog├®neas utilizando t├®cnicas para justificar la elecci├│n de las mismas, a partir de las propiedades fisicoqu├¡micas de las sustancias involucradas.ÔÇó	Crea m├®todos y/o sistemas de separaci├│n de los residuos s├│lidos que se producen en la instituci├│n.ÔÇó	Analiza los m├®todos de desecho de sustancias qu├¡micas para evitar la contaminaci├│n","Inicio (15 minutos):INSERT INTO `planeador_vallesol` VALUES("33","2024-09-29","2024-09-02","2024-09-06","6","111","4","2","Identifico principios cient├¡ficos aplicados al funcionamiento de algunos artefactos, productos, servicios, procesos y sistemas tecnol├│gicos.","Utilizaci├│n de analog├¡as y actividades pr├ícticas para facilitar la comprensi├│n de conceptos abstractos.","Usa la computadora como herramienta de comunicaci├│n e informaci├│n mediante la navegaci├│n por la web. (Sexualidad)","<p><strong>Inicio:</strong> Presentar una imagen o video de una red de computadoras (ej: una red social) https://www.youtube.com/watch?v=GqIFy_0di_Q</p><p>. Preguntar a los estudiantes qu├® saben sobre internet y c├│mo lo utilizan en su vida diaria. * <strong>Desarrollo:</strong> Explicar de manera sencilla qu├® es internet, utilizando analog├¡as con redes de carreteras o redes sociales. Presentar una imagen o diagrama de la estructura b├ísica de internet (servidores, clientes, routers). Realizar una actividad en la que los estudiantes simulen ser paquetes de informaci├│n viajando por internet. * <strong>Valoraci├│n:</strong> Realizar una lluvia de ideas sobre los diferentes usos de internet y sus beneficios. * <strong>Cierre:</strong> Resumir los conceptos clave de la clase y responder a las preguntas de los estudiantes</p>","     Im├ígenes de redes de computadoras, diagramas de la estructura de internet, videos explicativos, tarjetas para la actividad de simulaci├│n.","Observar si los estudiantes comprendieron los conceptos b├ísicos de internet. Identificar si es necesario reforzar alguna explicaci├│n.","dentificar sus componentes b├ísicos (servidores, clientes) y explicar c├│mo se conectan los dispositivos a la red.","Principales servicios de internet");
INSERT INTO `planeador_vallesol` VALUES("34","2024-09-29","2024-09-09","2024-09-13","6","111","4","2","Identifico principios cient├¡ficos aplicados al funcionamiento de algunos artefactos, productos, servicios, procesos y sistemas tecnol├│gicos.","Aprendizaje basado en problemas, gamificaci├│n.","Usa la computadora como herramienta de comunicaci├│n e informaci├│n mediante la navegaci├│n por la web. (Sexualidad)","<p><strong>Inicio:</strong> Se dar├í inicio a la clase con una din├ímica de b├║squeda competitiva entre los estudiantes, estimulando su curiosidad y habilidades de navegaci├│n web. Una vez identificada la informaci├│n objetivo, se proceder├í a una breve explicaci├│n de las partes fundamentales de un navegador web, enfatizando su rol como herramienta esencial para acceder a la vasta informaci├│n disponible en internet.</p><p><strong>Desarrollo:</strong> A continuaci├│n, se profundizar├í en las estrategias de b├║squeda efectiva, introduciendo conceptos como palabras clave, operadores booleanos y la utilizaci├│n de diferentes buscadores. Los estudiantes realizar├ín b├║squedas guiadas y explorar├ín distintos sitios web, evaluando la relevancia y confiabilidad de la informaci├│n obtenida.</p><p><strong>Consolidaci├│n:</strong> Para fortalecer los aprendizajes, se organizar├í un espacio de intercambio donde los estudiantes compartir├ín sus hallazgos y resultados de b├║squeda. A trav├®s de preguntas orientadoras, se fomentar├í la reflexi├│n cr├¡tica sobre la informaci├│n encontrada y se destacar├í la importancia de evaluar las fuentes.</p><p><strong>Cierre:</strong> Finalmente, se realizar├í una s├¡ntesis de los conceptos clave abordados durante la clase, enfatizando la utilidad del navegador web como herramienta de aprendizaje y comunicaci├│n. Se propondr├ín actividades complementarias para que los estudiantes contin├║en explorando el mundo digital de manera aut├│noma.</p>","     Diferentes navegadores web, dispositivos m├│viles con acceso a internet, hojas de trabajo.	","Observar si los estudiantes pueden encontrar la informaci├│n que necesitan de manera eficiente.","utilizar un navegador web para buscar informaci├│n y navegar por diferentes sitios web.","Principales servicios de internet");
INSERT INTO `planeador_vallesol` VALUES("35","2024-09-29","2024-09-16","2024-09-20","6","111","4","2","Identifico principios cient├¡ficos aplicados al funcionamiento de algunos artefactos, productos, servicios, procesos y sistemas tecnol├│gicos.","Aprendizaje basado en problemas, trabajo en grupo, debate.  Exportar a Hojas de c├ílculo","Usa la computadora como herramienta de comunicaci├│n e informaci├│n mediante la navegaci├│n por la web. (Sexualidad)","<p><strong>Inicio:</strong> La clase comenzar├í con una din├ímica de lluvia de ideas en la que los estudiantes compartir├ín las redes sociales que utilizan habitualmente. Esta actividad permitir├í activar los conocimientos previos de los alumnos y generar inter├®s en el tema.</p><p><strong>Desarrollo</strong> A continuaci├│n, se introducir├ín conceptos clave como \"algoritmo de recomendaci├│n\" y \"burbuja de filtro\" de manera sencilla y visual, utilizando ejemplos cotidianos. Se explicar├í c├│mo estos mecanismos influyen en el contenido que los usuarios ven en las redes sociales. Para profundizar en el tema, se realizar├í un an├ílisis de las redes sociales m├ís populares, destacando sus caracter├¡sticas principales y su impacto en la sociedad.</p><p><strong>Consolidaci├│n :</strong> Se organizar├í un debate en el que los estudiantes expresar├ín sus opiniones sobre los pros y los contras del uso de las redes sociales. Se fomentar├í la participaci├│n activa y respetuosa, valorando diferentes puntos de vista. El docente actuar├í como moderador, asegurando que la discusi├│n se mantenga enfocada en los aspectos clave del tema.</p><p><strong>Cierre:</strong> Para finalizar la clase, se realizar├í una s├¡ntesis de los principales aprendizajes y se propondr├í a los estudiantes la creaci├│n de un dec├ílogo de consejos para utilizar las redes sociales de manera segura y responsable. Esta actividad permitir├í a los estudiantes aplicar los conocimientos adquiridos y reflexionar sobre su propio uso de las redes sociales.</p>"," Presentaciones con im├ígenes y videos, ejemplos de publicaciones en redes sociales, sitios web con informaci├│n sobre seguridad en l├¡nea.","Observar si los estudiantes pueden identificar los diferentes tipos de redes sociales y los riesgos asociados. Evaluar si han desarrollado un pensamiento cr├¡tico sobre el uso de estas plataformas.","identificar los diferentes tipos de redes sociales, comprender c├│mo funcionan los algoritmos de recomendaci├│n y evaluar los riesgos asociados al uso de estas plataformas.","Principales servicios de internet");
INSERT INTO `planeador_vallesol` VALUES("36","2024-09-29","2024-09-23","2024-09-27","6","111","4","2","Identifico principios cient├¡ficos aplicados al funcionamiento de algunos artefactos, productos, servicios, procesos y sistemas tecnol├│gicos.","Aprendizaje basado en proyectos, trabajo en equipo, presentaci├│n de resultados.  Exportar a Hojas de c├ílculo","Usa la computadora como herramienta de comunicaci├│n e informaci├│n mediante la navegaci├│n por la web. (Sexualidad)","<p><strong>Inicio </strong></p><ul><li><strong>Presentaci├│n motivadora:</strong> Comienza la clase presentando ejemplos de campa├▒as publicitarias exitosas en redes sociales que sean relevantes para los estudiantes (por ejemplo, influencers que promueven productos que ellos conocen).</li><li><strong>Introducci├│n al concepto:</strong> Explica de manera sencilla qu├® es una estrategia de contenido y c├│mo las marcas y personas utilizan las redes sociales para comunicarse con su audiencia.</li><li><strong>Pregunta generadora:</strong> Plantea una pregunta abierta para despertar la curiosidad de los estudiantes: \"┬┐Qu├® hace que una campa├▒a en redes sociales sea exitosa?\".</li></ul><p><strong>Desarrollo </strong></p><ul><li><strong>Divisi├│n en equipos:</strong> Organiza a los estudiantes en equipos de 3 o 4 integrantes.</li><li><strong>Asignaci├│n de marcas ficticias:</strong> Asigna a cada equipo una marca o persona ficticia (puede ser una marca real simplificada o una creada especialmente para la actividad).</li><li><strong>Investigaci├│n y an├ílisis:</strong> Los equipos investigar├ín a su audiencia objetivo (edad, intereses, etc.), definir├ín los objetivos de su estrategia (dar a conocer la marca, aumentar las ventas, etc.) y seleccionar├ín las plataformas sociales m├ís adecuadas.</li><li><strong>Creaci├│n del calendario editorial:</strong> Guiados por el docente, los estudiantes crear├ín un calendario editorial b├ísico, indicando el tipo de contenido que publicar├ín (fotos, videos, encuestas, etc.) y la frecuencia de publicaci├│n.</li></ul><p><strong>Consolidaci├│n </strong></p><ul><li><strong>Presentaci├│n de las estrategias:</strong> Cada equipo presentar├í su estrategia al resto de la clase, explicando las razones detr├ís de sus decisiones.</li><li><strong>Retroalimentaci├│n:</strong> Fomenta un ambiente de colaboraci├│n y respeto, donde los estudiantes se den comentarios constructivos sobre las estrategias de sus compa├▒eros.</li><li><strong>Valoraci├│n:</strong> El docente ofrecer├í una valoraci├│n general de las actividades, resaltando los aspectos positivos y sugiriendo mejoras.</li></ul><p><strong>Cierre </strong></p><ul><li><strong>Resumen de los conceptos clave:</strong> Repasa los elementos clave de una estrategia de contenido exitosa (audiencia, objetivos, plataformas, calendario editorial).</li><li><strong>Importancia de la medici├│n:</strong> Explica brevemente la importancia de medir los resultados de una campa├▒a en redes sociales para evaluar su ├®xito.</li><li><strong>Proyecto final (opcional):</strong> Anuncia que en la pr├│xima clase los estudiantes podr├ín desarrollar su estrategia de contenido de manera m├ís detallada y creativa.</li></ul><p><br></p>","     ejemplos de estrategias de contenido exitosas, estudios de caso.","Los estudiantes Evaluan l as plataformas sociales adecuadas para diferentes p├║blicos","desarrollar una estrategia de contenido integral para la instituci├│n educativa","Principales servicios de internet");
INSERT INTO `planeador_vallesol` VALUES("37","2024-10-10","2024-09-02","2024-09-06","11","112","4","2","Utiliza responsablemente productos tecnol├│gicos, valorando su pertinencia, calidad y efectos potenciales sobre la salud y el medio ambiente.","Aprendizaje basado en problemas y trabajo colaborativo.","INSERT INTO `planeador_vallesol` VALUES("38","2024-09-29","2024-09-09","2024-09-13","8","112","4","2","Utiliza responsablemente productos tecnol├│gicos, valorando su pertinencia, calidad y efectos potenciales sobre la salud y el medio ambiente.","Aprendizaje por descubrimiento y pr├íctica guiada.","Hace un uso adecuado del correo electr├│nico.","<p><strong>Inicio :</strong></p><ul><li><strong>Revisi├│n del concepto de buscador:</strong> Comienza con una breve lluvia de ideas para activar los conocimientos previos de los estudiantes sobre qu├® es un buscador y para qu├® sirve.</li><li><strong>Presentaci├│n de diferentes buscadores:</strong> Muestra una variedad de buscadores (Google, Bing, DuckDuckGo, etc.) y destaca sus caracter├¡sticas principales.</li><li><strong>Pregunta desafiante:</strong> Plantea una pregunta abierta que requiera una b├║squeda en Internet para generar curiosidad: \"┬┐Cu├íl es la poblaci├│n de ping├╝inos emperador en la Ant├írtida?\"</li></ul><p><strong>Desarrollo :</strong></p><ul><li><strong>Pr├íctica guiada:</strong> Realiza una b├║squeda en vivo en un buscador, mostrando paso a paso c├│mo utilizar operadores de b├║squeda (AND, OR, NOT) y comillas para refinar los resultados.</li><li><strong>Actividad en parejas:</strong> Divide a los estudiantes en parejas y asigna a cada pareja una pregunta de b├║squeda m├ís compleja (por ejemplo, \"Cu├íl es el impacto del cambio clim├ítico en los oc├®anos\").</li><li><strong>Evaluaci├│n de resultados:</strong> Los estudiantes evaluar├ín la relevancia de los resultados obtenidos, identificando las fuentes m├ís confiables y explicando por qu├® eligieron esa informaci├│n.</li></ul><p><strong>Consolidaci├│n :</strong></p><ul><li><strong>Debate:</strong> Organiza un debate sobre la importancia de saber buscar informaci├│n en Internet de forma efectiva y cr├¡tica.</li><li><strong>Creaci├│n de una gu├¡a r├ípida:</strong> De forma colaborativa, se crea una orientaci├│n  con los consejos m├ís importantes para realizar b├║squedas efectivas en Internet (utilizar palabras clave precisas, evaluar la credibilidad de las fuentes, etc.).</li><li><strong>Presentaci├│n de herramientas adicionales:</strong> Introduce brevemente otras herramientas de b├║squeda como Google Scholar (para b├║squedas acad├®micas) o bibliotecas digitales.</li></ul><p><strong>Cierre :</strong></p><ul><li><strong>Resumen de los aprendizajes:</strong> Repasa los conceptos clave trabajados durante la clase, enfatizando la importancia de desarrollar habilidades de b├║squeda efectiva para la vida acad├®mica y profesional.</li><li><strong>Reflexi├│n personal:</strong> Pide a los estudiantes que reflexionen sobre c├│mo pueden aplicar lo aprendido en sus estudios y en su vida diaria</li></ul><p><br></p>","     Computador con acceso a internet, proyector.","Aprendizaje por descubrimiento y pr├íctica guiada.","Comprender el funcionamiento b├ísico de un buscador de internet.","Principales servicios de internet");
INSERT INTO `planeador_vallesol` VALUES("39","2024-09-29","2024-09-23","2024-09-27","8","112","4","2","Utiliza responsablemente productos tecnol├│gicos, valorando su pertinencia, calidad y efectos potenciales sobre la salud y el medio ambiente.","Aprendizaje basado en proyectos y trabajo individual.","Hace un uso adecuado del correo electr├│nico.","<p><strong>Inicio :</strong></p><ul><li><strong>Revisi├│n del concepto de sitio web:</strong> Comienza con una lluvia de ideas para activar los conocimientos previos de los estudiantes sobre qu├® es un sitio web y para qu├® sirve.</li><li><strong>Presentaci├│n de ejemplos:</strong> Muestra una variedad de sitios web (personales, empresariales, informativos, etc.) y destaca sus caracter├¡sticas principales.</li><li><strong>Pregunta desafiante:</strong> Plantea una pregunta que motive la reflexi├│n: \"┬┐Qu├® elementos consideras que hacen que un sitio web sea atractivo y ├║til?\"</li></ul><p><strong>Desarrollo :</strong></p><ul><li><strong>Explicaci├│n de los elementos b├ísicos:</strong> Explica de manera clara y concisa los elementos fundamentales de un sitio web (estructura, dise├▒o, contenido, navegaci├│n).</li><li><strong>Demostraci├│n pr├íctica:</strong> Utiliza una plataforma de creaci├│n de sitios web (Wix, Weebly, etc.) para mostrar c├│mo crear una p├ígina b├ísica.</li><li><strong>Trabajo en parejas:</strong> Divide a los estudiantes en parejas y asigna a cada pareja un tema o nicho para su sitio web (por ejemplo, un blog sobre videojuegos, un portafolio de un artista, etc.).</li></ul><p><strong>Consolidaci├│n :</strong></p><ul><li><strong>Creaci├│n de los sitios web:</strong> Los estudiantes trabajar├ín en parejas para crear un sitio web, aplicando los conocimientos adquiridos en la sesi├│n.</li><li><strong>Presentaci├│n de los sitios web:</strong> Cada pareja presentar├í el contenido para gestionar el sitio web al resto de la clase, explicando las decisiones que tomaron en cuanto al dise├▒o, contenido y estructura.</li><li><strong>Retroalimentaci├│n:</strong> Fomenta un ambiente de colaboraci├│n y respeto, donde los estudiantes se den comentarios constructivos sobre los sitios web de sus compa├▒eros.</li></ul><p><strong>Cierre :</strong></p><ul><li><strong>Resumen de los aprendizajes:</strong> Repasa los conceptos clave trabajados durante la clase, enfatizando la importancia de un buen dise├▒o web y la organizaci├│n del contenido.</li><li><strong>Reflexi├│n personal:</strong> Pide a los estudiantes que reflexionen sobre los desaf├¡os y las satisfacciones que encontraron al crear su sitio web.</li><li><strong>Posibles mejoras:</strong> Abre un espacio para que los estudiantes sugieran mejoras para sus sitios web y para la pr├│xima clase.</li></ul><p><br></p>","     Computadoras con acceso a internet, proyector, plataforma de creaci├│n de sitios web (Wix, Weebly).","Observar si los estudiantes pueden aplicar los conocimientos adquiridos para crear un producto digital.","Crear un espacio digital aplicando normas de uso responsable","Principales servicios de internet");
INSERT INTO `planeador_vallesol` VALUES("40","2025-02-08","2025-01-27","2025-01-24","10","16","1","2","Evalúa la importancia de la solución negociada de los conflictos armados para la búsqueda de la paz.","Trabajo en grupo : Orientación de los docentes a los grupos para que llas preguntas, reflexiones para el conocimiento sea conjunto","Explica la importancia que tiene para una sociedad la resolución pacífica de sus conflictos y el respeto por las diferencias políticas, ideológicas, de género, religiosas, étnicas o intereses económicos.","<p><strong>Introducción </strong></p><ul><li>Saludo y presentación del tema: \"Hoy vamos a explorar el mundo de la economía y la política, dos áreas que influyen en nuestra vida diaria de muchas maneras.\"</li><li>Pregunta inicial: \"¿Qué saben sobre economía y política? ¿Dónde escuchan hablar de estos temas?\"</li><li>Recoger ideas previas de los estudiantes.</li></ul><p><strong>Derechos Básicos de Aprendizaje (DBA) </strong></p><ul><li>Presentación de los DBA relacionados con el tema de la clase.</li><li>Explicación de su importancia: \"Los DBA son como los cimientos de nuestro aprendizaje. Nos dicen qué debemos saber y saber hacer.\"</li><li>Ejemplo práctico: Leer un DBA y relacionarlo con una situación cotidiana.</li></ul><p><strong>Estándares y Evidencias de Aprendizaje (15 minutos)</strong></p><ul><li>Presentación de los estándares de aprendizaje correspondientes a los DBA.</li><li>Explicación de cómo se relacionan los estándares con los DBA.</li><li>Descripción de las evidencias de aprendizaje: \"Las evidencias son las pruebas de que estamos aprendiendo. Son las tareas, trabajos y actividades que hacemos.\"</li></ul><p><strong>Introducción a la Economía y la Política (20 minutos)</strong></p><ul><li>Explicación de conceptos básicos de economía: \"La economía es cómo las sociedades organizan la producción, distribución y consumo de bienes y servicios.\"</li><li>Ejemplos: Necesidades básicas, escasez, oferta y demanda.</li><li>Explicación de conceptos básicos de política: \"La política es cómo se toman decisiones en un grupo o sociedad, especialmente en relación con el gobierno.\"</li><li>Ejemplos: Democracia, elecciones, leyes.</li><li>Utilizar ejemplos sencillos y cercanos a la realidad de los estudiantes.</li></ul><p><strong>Dinámica: \"Titulares en Acción\" (25 minutos)</strong></p><ul><li>Dividir a los estudiantes en grupos pequeños.</li><li>Entregar a cada grupo recortes de noticias o artículos relacionados con la economía y la política.</li><li>Pedir a cada grupo que:</li><li class=\"ql-indent-1\">Lean el titular y el primer párrafo de la noticia.</li><li class=\"ql-indent-1\">Identifiquen los conceptos de economía o política que se mencionan.</li><li class=\"ql-indent-1\">Inventen un titular creativo y llamativo para la misma noticia.</li><li>Cada grupo comparte su titular y explica por qué lo eligió.</li></ul><p><strong>Cierre ()</strong></p><ul><li>Resumen de los puntos clave de la clase.</li><li>Pregunta final: \"¿Cómo creen que la economía y la política nos afectan en nuestra vida?\"</li><li>Tarea: Buscar noticias o ejemplos de economía y política en su entorno.</li></ul><p><br></p>","    Revista, cuaderno, tv","La politica es un componente importante para los niños ya que presentan posiciones al respecto de la situaciones del pais","Conocer los estándares de aprendizaje y las evidencias de aprendizaje relacionadas con la economía y la política.","Sociedad civil y conflicto armado");
INSERT INTO `planeador_vallesol` VALUES("41","2025-02-08","2025-01-27","2025-01-31","6","3","1","2","• Analiza como en las sociedades antiguas surgieron las primeras ciudades y el papel de la agricultura y el comercio para la expansión de estas.• Analiza las distintas formas de gobierno ejercidas en la antigüedad y las compara con el ejercicio del poder político en el mundo contemporáneo.• Analiza cómo en el escenario político democrático entran en juego intereses desde diferentes sectores sociales, políticos y económicos, los cuales deben ser dirimidos por los ciudadanos.","TALLER : Implica como su nombre lo dice, un lugar donde se trabaja y labora. Es una forma de enseñar y aprender mediante la realización de algo, es decir aprender haciendo. En esta estrategia predomina y se privilegia, el aprendizaje sobre la enseñanza. Se trata entonces de aprender haciendo, desarrollando habilidades donde los conocimientos se adquieren a través de una práctica concreta; ejecutando algo relacionado con el objetivo que se pretende alcanzar, en  un contexto particular de aprendizaje. Es una metodología participativa en la que se enseña y se aprende a través de una tarea conjunta. Su metodología descansa en la actividad del estudiante y en la organización basada en pequeños grupos. La utilización de este método tiene como cometido dar respuesta a preguntas planteadas en las consignas de trabajo, teniendo en cuenta la opinión de todos los miembros del grupo, para llegar a una toma de decisiones colectiva. Desarrollando el taller en  la práctica de conocimientos para despertar el interés en los","• Relaciona el origen de la agricultura con el desarrollo de las sociedades antiguas y la aparición de elementos que permanecen en la actualidad (canales de riego, la escritura, el ladrillo).• Explica el papel de los ríos Nilo, Tigris, Éufrates, Indo, Ganges, Huang He y Yangtsé Kiang, en la construcción de las primeras ciudades y el origen de las civilizaciones antiguas y los ubica en un mapa actual de África y Asia.• Describe semejanzas y diferencias que se observan entre la democracia ateniense y las democracias actuales, en especial la colombiana, para señalar fortalezas, debilidades y alternativas que conduzcan a una mayor democratización.• Describe el origen de la ciudadanía, los cambios que ha tenido en el tiempo y su significado actual.• Argumenta la importancia de participar activamente en la toma de decisiones para el bienestar colectivo en la sociedad, en el contexto de una democracia.• Participa activamente en la construcción de los protocolos de seguridad de la Institución Educativa.","<p><strong>Introducción </strong></p><ul><li>Saludo y presentación del tema: \"vamos a embarcarnos en un viaje a los orígenes como pueblos.\"</li><li>Pregunta inicial: \"¿Qué saben sobre los primeros humanos y cómo se organizaron?\"</li><li>Recoger ideas previas de los estudiantes.</li></ul><p><strong>Derechos Básicos de Aprendizaje (DBA) ()</strong></p><ul><li>Presentación de los DBA de Ciencias Sociales para grado 6 relacionados con la historia y la cultura.</li><li>Explicación de su importancia: \"Los DBA nos guían para aprender sobre nuestro pasado y entender el presente.\"</li><li>Ejemplo práctico: Leer un DBA y relacionarlo con el tema de la clase.</li></ul><p><strong>Estándares y Evidencias de Aprendizaje ()</strong></p><ul><li>Presentación de los estándares de aprendizaje correspondientes a los DBA.</li><li>Explicación de cómo se relacionan los estándares con los DBA.</li><li>Descripción de las evidencias de aprendizaje: \"Las evidencias son las pruebas de que estamos aprendiendo. Son las tareas, trabajos y actividades que hacemos.\"</li></ul><p><strong>Introducción al Origen de los Pueblos ()</strong></p><ul><li>Explicación del concepto de origen de los pueblos: \"Los pueblos tienen historias únicas, culturas diversas y formas de vida propias.\"</li><li>Importancia de conocer nuestros orígenes: \"Entender de dónde venimos nos ayuda a comprendernos mejor a nosotros mismos y a valorar nuestra diversidad.\"</li><li>Utilizar mapas, imágenes y líneas de tiempo para visualizar la información.</li></ul><p><strong>Dinámica: \"Construyendo Nuestra Historia\" ()</strong></p><ul><li>	Crear un árbol de genealógico de la historia familiar de cada uno de los estudiantes</li></ul><p><strong>Cierre (</strong></p><ul><li>Resumen de los puntos clave de la clase.</li><li>Pregunta final: \"¿Por qué es importante estudiar el origen de los pueblos?\"</li></ul>","    Cuaderno","Conocer la historia de los estudiantes generan un impacto en el grupo ya que se conocen que hay historias familiares interesantes y de superación","Conocer los estándares de aprendizaje y las evidencias de aprendizaje para grado 6 en Ciencias Sociales.","Democracia, Gobierno escolar, Legado cultural, social, económico");
INSERT INTO `planeador_vallesol` VALUES("42","2025-02-08","2025-01-27","2025-01-31","6","13","1","1","Comprende el emprendimiento con sus mitos y realidades. Reconoce en su entorno cercano actividades contables y analiza la diferencia entre decisiones democráticas y autocráticas que pueden tomarse dentro de una empresa.","DISCUSIÓN DIRIGIDA : Consiste en discutir un tema, bajo la dirección del educador. Su principal uso consiste en dirigir el diálogo mediante preguntas específicas hacia un objetivo común. Después de la discusión se aceptarán las conclusiones  de la mayoría por medio de un trabajo de colaboración intelectual. Lo anterior permite","Analiza la importancia de la mentalidad emprendedora como estrategia para mejorar su calidad de vida y la de su entorno cercano y lejano. Propone normas de seguridad en los proyectos emprendedores de la vereda y tiene en cuenta su entorno para beneficiarse del emprendimiento.","<p><strong>Introducción </strong></p><ul><li>Saludo y presentación del tema: \"Hoy vamos a descubrir el mundo del emprendimiento y cómo podemos convertir nuestras ideas en realidad.\"</li><li>Pregunta inicial: \"¿Qué es para ti emprender? ¿Conoces a algún emprendedor?\"</li><li>Recoger ideas previas de los estudiantes.</li></ul><p><strong>Derechos Básicos de Aprendizaje (DBA) ()</strong></p><ul><li>Presentación de los DBA de Emprendimiento para grado 6.</li><li>Explicación de su importancia: \"Los DBA nos guían para desarrollar habilidades emprendedoras y construir nuestro futuro.\"</li><li>Ejemplo práctico: Leer un DBA y relacionarlo con una situación cotidiana.</li></ul><p><strong>Estándares y Evidencias de Aprendizaje </strong></p><ul><li>Presentación de los estándares de aprendizaje correspondientes a los DBA.</li><li>Explicación de cómo se relacionan los estándares con los DBA.</li><li>Descripción de las evidencias de aprendizaje: \"Las evidencias son las pruebas de que estamos aprendiendo. Son las tareas, trabajos y proyectos que hacemos.\"</li></ul><p><strong>Introducción al Emprendimiento y Mentalidad Emprendedora (20 minutos)</strong></p><ul><li>Explicación del concepto de emprendimiento: \"Emprender es identificar una oportunidad y crear algo nuevo para satisfacer una necesidad o resolver un problema.\"</li><li>Características de la mentalidad emprendedora:</li><li class=\"ql-indent-1\">Creatividad e innovación.</li><li class=\"ql-indent-1\">Pasión y perseverancia.</li><li class=\"ql-indent-1\">Toma de riesgos y aprendizaje de los errores.</li><li class=\"ql-indent-1\">Orientación a la acción y al logro.</li><li>Historias de emprendedores exitosos: Presentar ejemplos de personas que han logrado sus sueños emprendiendo.</li></ul><p><strong>Dinámica: \"Lluvia de Ideas Emprendedoras\" (25 minutos)</strong></p><ul><li>Dividir a los estudiantes en grupos pequeños.</li><li>Plantear un desafío o problema común en su entorno (ej: falta de espacios verdes, necesidad de productos útiles, etc.).</li><li>Pedir a cada grupo que:</li><li class=\"ql-indent-1\">Realicen una lluvia de ideas para encontrar soluciones creativas al desafío.</li><li class=\"ql-indent-1\">Seleccionen la mejor idea y la desarrollen un poco más (ej: ¿qué producto o servicio crearían?, ¿a quiénes se lo venderían?, ¿cómo lo promocionarían?).</li><li>Cada grupo comparte su idea y explica cómo la desarrollarían.</li></ul><p><strong>Cierre ()</strong></p><ul><li>Resumen de los puntos clave de la clase.</li><li>Pregunta final: \"¿Qué ideas de negocio se te ocurren a ti?\"</li><li>Tarea: Investigar sobre emprendedores locales o proyectos innovadores en su comunidad.</li></ul><p><br></p>","     Cuaderno","Los estudiantes presentan muchas ideas de emprendimeinto para su munucipio","Comprender los Derechos Básicos de Aprendizaje (DBA) relacionados con el emprendimiento.","Emprendimiento");
