je: \"Las evidencias son las pruebas de que estamos aprendiendo. Son las tareas, trabajos y proyectos que hacemos.\"</li></ul><p><strong>Introducción al Emprendimiento y Mentalidad Emprendedora (20 minutos)</strong></p><ul><li>Explicación del concepto de emprendimiento: \"Emprender es identificar una oportunidad y crear algo nuevo para satisfacer una necesidad o resolver un problema.\"</li><li>Características de la mentalidad emprendedora:</li><li class=\"ql-indent-1\">Creatividad e innovación.</li><li class=\"ql-indent-1\">Pasión y perseverancia.</li><li class=\"ql-indent-1\">Toma de riesgos y aprendizaje de los errores.</li><li class=\"ql-indent-1\">Orientación a la acción y al logro.</li><li>Historias de emprendedores exitosos: Presentar ejemplos de personas que han logrado sus sueños emprendiendo.</li></ul><p><strong>Dinámica: \"Lluvia de Ideas Emprendedoras\" (25 minutos)</strong></p><ul><li>Dividir a los estudiantes en grupos pequeños.</li><li>Plantear un desafío o problema común en su entorno (ej: falta de espacios verdes, necesidad de productos útiles, etc.).</li><li>Pedir a cada grupo que:</li><li class=\"ql-indent-1\">Realicen una lluvia de ideas para encontrar soluciones creativas al desafío.</li><li class=\"ql-indent-1\">Seleccionen la mejor idea y la desarrollen un poco más (ej: ¿qué producto o servicio crearían?, ¿a quiénes se lo venderían?, ¿cómo lo promocionarían?).</li><li>Cada grupo comparte su idea y explica cómo la desarrollarían.</li></ul><p><strong>Cierre ()</strong></p><ul><li>Resumen de los puntos clave de la clase.</li><li>Pregunta final: \"¿Qué ideas de negocio se te ocurren a ti?\"</li><li>Tarea: Investigar sobre emprendedores locales o proyectos innovadores en su comunidad.</li></ul><p><br></p>","     tv, cuaderno","Los estudiantes presentan muchas ideas de emprendimeinto para su munucipio","Comprender los Derechos Básicos de Aprendizaje (DBA) relacionados con el emprendimiento.","Conceptos clave de emprendimiento");
INSERT INTO `planeador_vallesol` VALUES("44","2025-02-26","2025-02-27","2025-02-27","6","9","1","1","Identifica la buena alimentación y cómo debe nutrirse un deportista. Reflexiona sobre sus actos y las consecuencias de estos como oportunidad para una mejor convivencia escolar. Conoce los posibles riesgos a su integridad física al realizar una actividad física.","Evaluación formativa motriz: Retroalimentación continua sobre el desempeño físico para identificar áreas de mejora y establecer metas personales","Asimila y emplea una terminología específica del área. Comprende la importancia del diagnóstico físico. Incluye el calentamiento como hábito de salud y prevención física. Valora la importancia del sistema esquelético para el desempeño personal. Identifica las lesiones más comunes en los atletas y la forma de prevenirlas.","<p>Se realiza un ejercicio de calentamiento en el que van trotando alrededor de la cancha y cada uno de los estudiantes van tirando los balones al aire con el fin de que los estudiantes de la parte de atrás evitando que el balón caiga ,si el balón cae se debe evitar, quien deja caer el balón debe quedarse haciendo sapitos mientras los demás terminan la actividad.</p><ul><li>Se colocan 5 conos uno frente de otro y se procede en zic zac a mientras que en cada cono debe el otro compañero comenzar a pasar el balón y devolverlo https://www.tiktok.com/@deportes.tok/video/7426530997581139205?_r=1&amp;_t=ZS-8uFMghKkpDc</li><li>Posterior al calentamiento los estudiantes deben seleccionar parejas para rivalizar y pasar el balón desde el inicio de la cancha hasta la mitad y luego  debe salir corriendo con el balón driblando hasta realizar la cesta.</li><li>Se colocan 5 conos en diagonal a la canasta de baloncesto para cada estudiante teniendo en cuenta que cada estudiante tienen su rival https://vt.tiktok.com/ZSMyfxse3/</li></ul><p>Finalmente se brinda una retroalimentación de las capacidades coordinativas de los estudiantes y se procede a brindar una valoración </p><p><br></p><p><br></p>","     balones,conos","La competitividad es un factor fundamental en el desarrollo fisico de los estudiantes","Determinar las capacidades coordinativas de los estudiantes","Terminología básica y hábitos saludables");
INSERT INTO `planeador_vallesol` VALUES("45","2025-02-26","2025-02-27","2025-02-27","9","9","1","1","Identifica la buena alimentación y cómo debe nutrirse un deportista. Reflexiona sobre sus actos y las consecuencias de estos como oportunidad para una mejor convivencia escolar. Conoce los posibles riesgos a su integridad física al realizar una actividad física.","Evaluación formativa motriz: Retroalimentación continua sobre el desempeño físico para identificar áreas de mejora y establecer metas personales","Asimila y emplea una terminología específica del área. Comprende la importancia del diagnóstico físico. Incluye el calentamiento como hábito de salud y prevención física. Valora la importancia del sistema esquelético para el desempeño personal. Identifica las lesiones más comunes en los atletas y la forma de prevenirlas.","<p>Se inicia la clase dando la bienvenida a los estudiantes y motivando a desarrollar un calentamiento:</p><ul><li>Se inicia el calentamiento de los estudiantes en el que se realiza un circulo y se comienza a lanzar el balón para arriba y los estudiantes de la parte de atras deben atraparlo sin dejarlo caer mientras que los estudiantes que pierden el balón deben realizar sapitos mientras termina el calentamiento</li><li>Se colocan conos en diagonal uno frente a otro y el estudiante debe pasar el balón en zic zac mientras el  compañero al frente le debe tirar el balón y debe devolverlo en cada parada del cono https://www.tiktok.com/@deportes.tok/video/7426530997581139205?_r=1&amp;_t=ZS-8uFMghKkpDc</li><li>Luego se coloca los estudiantes en el inicio de la cancha y los estudiantes deben seleccionar un compañero para pasar el balón hasta la mitad de la cancha y posterior al llegar a la mitad de la cancha los estudiantes deben lanzar el balón driblando hasta llegar a la cesta con el balón quien lo logre será el ganador</li><li>De manera diagonal se procede a colocar 5 conos por estudiante  para que los estudiantes puedan correr en un versus con un rival https://www.tiktok.com/@jon.basketball/video/7304057097824505094?_r=1&amp;_t=ZS-8uFLeJph58B</li></ul><p>Finalmente se hace un cierre de capacidades coordinativas , reflexión .</p>","     balones,conos","La competitividad es un factor fundamental en el desarrollo fisico de los estudiantes","Determinar las capacidades coordinativas de los estudiantes","Terminología básica y hábitos saludables");
INSERT INTO `planeador_vallesol` VALUES("46","2025-02-26","2025-02-27","2025-02-27","6","1","1","2","Utiliza las propiedades de los números enteros y racionales y las propiedades de sus operaciones para proponer estrategias y procedimientos de cálculo en la solución de problemas. Reconoce y establece diferentes relaciones (orden y equivalencia) entre elementos de diversos dominios numéricos y los utiliza para argumentar procedimientos sencillos.","Aprendizaje Experiencial:Los estudiantes aprenden a traves de la experiencia directa, aplicando conocimientos en contextos proyectos o simulados.","Propone y justifica diferentes estrategias para resolver problemas con números enteros y racionales en contextos escolares y extraescolares. Determina criterios de comparación para establecer relaciones de orden entre dos o más números. Representa en la recta numérica la posición de un número utilizando diferentes estrategias.","<p>Inicio :</p><p>Actividad de Introducción Interactiva:</p><p>Inicia la clase con una pregunta intrigante: \"¿Qué tienen en común un velocista que corre 100 metros en 9.58 segundos, el precio de un kilogramo de manzanas a $2.75 y la medida de su estatura en metros?\". Permite que los estudiantes reflexionen y compartan sus ideas.</p><p>Presenta una imagen o un video corto que muestre diversas situaciones donde se usan números decimales (deportes, compras, medidas).</p><p>Realiza una breve lluvia de ideas sobre dónde más han visto números con comas.</p><p><br></p><p>Desarrollo:</p><p>Exploración Conceptual:</p><p>Define formalmente los números decimales como números que tienen una parte entera y una parte decimal, separadas por una coma decimal.</p><p>Explica el valor posicional en números decimales: décimas (1/10), centésimas (1/100), milésimas (1/1000), etc.</p><p>Utiliza la pizarra o la presentación para mostrar ejemplos de números decimales y cómo se leen.</p><p>Realiza ejercicios de identificación: pide a los estudiantes que identifiquen la parte entera y la parte decimal en diferentes números. Realiza un avance de las actividades de la unidad 1 de su libro de postprimaria</p><p><br></p><p>Revisión y Reflexión:</p><p>Se Revisa los conceptos clave de la lección: definición de decimales, valor posicional, aplicaciones prácticas. Pide a los estudiantes que compartan sus aprendizajes y cómo los aplicarán en su vida diaria.</p><p><br></p>","     Libro, Cuaderno","El aprendizaje colaborativo es una gran herramienta de aprendizaje ya qye permite reforzar y complementar el aprendizaje","Reconocer y aplicar números decimales en situaciones de la vida cotidiana.","Números y operaciones");
INSERT INTO `planeador_vallesol` VALUES("47","2025-03-02","2025-03-03","2025-03-03","10","16","1","2","Evalúa la importancia de la solución negociada de los conflictos armados para la búsqueda de la paz.","TALLER:Implica como su nombre lo dice, un lugar donde se trabaja y labora. Es una forma de enseñar y aprender mediante la realización de algo, es decir aprender haciendo. En esta estrategia predomina y se privilegia, el aprendizaje sobre la enseñanza. Se trata entonces de aprender haciendo, desarrollando habilidades donde los conocimientos se adquieren a través de una práctica concreta; ejecutando algo relacionado con el objetivo que se pretende alcanzar, en un contexto particular de aprendizaje. Es una metodología participativa en la que se enseña y se aprende a través de una tarea conjunta. Su metodología descansa en la actividad del estudiante y en la organización basada en pequeños grupos. La utilización de este método tiene como cometido dar respuesta a preguntas planteadas en las consignas de trabajo, teniendo en cuenta la opinión de todos los miembros del grupo, para llegar a una toma de decisiones colectiva. Desarrollando el taller en la práctica de conocimientos para despertar el interés en los estud","Explica la importancia que tiene para una sociedad la resolución pacífica de sus conflictos y el respeto por las diferencias políticas, ideológicas, de género, religiosas, étnicas o intereses económicos.","","  Examen de democracia (previamente impreso) Cuadernos y tareas de los estudiantes Registro de horas sociales","El proceso de aprendizaje previo mediante historias genera en algunos estudiantes mayor impacto en el aprendizaje","Explicar el desarrollo historico de la democracia y su relación con la historia actual ","Sociedad civil y conflicto armado");
INSERT INTO `planeador_vallesol` VALUES("48","2025-03-02","2025-03-03","2025-03-03","6","3","1","2","• Analiza como en las sociedades antiguas surgieron las primeras ciudades y el papel de la agricultura y el comercio para la expansión de estas.• Analiza las distintas formas de gobierno ejercidas en la antigüedad y las compara con el ejercicio del poder político en el mundo contemporáneo.• Analiza cómo en el escenario político democrático entran en juego intereses desde diferentes sectores sociales, políticos y económicos, los cuales deben ser dirimidos por los ciudadanos.","Exposición: implica una planificación y ejecución cuidadosas para transmitir información de manera efectiva.","• Relaciona el origen de la agricultura con el desarrollo de las sociedades antiguas y la aparición de elementos que permanecen en la actualidad (canales de riego, la escritura, el ladrillo).• Explica el papel de los ríos Nilo, Tigris, Éufrates, Indo, Ganges, Huang He y Yangtsé Kiang, en la construcción de las primeras ciudades y el origen de las civilizaciones antiguas y los ubica en un mapa actual de África y Asia.• Describe semejanzas y diferencias que se observan entre la democracia ateniense y las democracias actuales, en especial la colombiana, para señalar fortalezas, debilidades y alternativas que conduzcan a una mayor democratización.• Describe el origen de la ciudadanía, los cambios que ha tenido en el tiempo y su significado actual.• Argumenta la importancia de participar activamente en la toma de decisiones para el bienestar colectivo en la sociedad, en el contexto de una democracia.• Participa activamente en la construcción de los protocolos de seguridad de la Institución Educativa.","","     Carteleras, maquetas, presentaciones","El trabajo  articulado facilita la comprensión de de diversos conceptos e integra los conocimientos","Identificar las características principales de los pueblos originarios ","Democracia, Gobierno escolar, Legado cultural, social, económico");
INSERT INTO `planeador_vallesol` VALUES("49","2025-03-02","2025-03-02","2025-03-02","6","13","1","1","Comprende el emprendimiento con sus mitos y realidades. Reconoce en su entorno cercano actividades contables y analiza la diferencia entre decisiones democráticas y autocráticas que pueden tomarse dentro de una empresa.","DISCUSIÓN DIRIGIDA:Consiste en discutir un tema, bajo la dirección del educador. Su principal uso consiste en dirigir el diálogo mediante preguntas específicas hacia un objetivo común. Después de la discusión se aceptarán las conclusiones de la mayoría por medio de un trabajo de colaboración intelectual.","Analiza la importancia de la mentalidad emprendedora como estrategia para mejorar su calidad de vida y la de su entorno cercano y lejano. Propone normas de seguridad en los proyectos emprendedores de la vereda y tiene en cuenta su entorno para beneficiarse del emprendimiento.","","     Cartulina, papel en blanco, marcadores ","La proyección de futuro permite a los estudiantes motivarse sobre su futuro y trabajar en él","Identificar fortalezas, intereses y oportunidades en sus proyecto de vida ","Emprendimiento");
INSERT INTO `planeador_vallesol` VALUES("50","2025-03-02","2025-03-03","2025-03-03","9","14","1","1","Comprende, vivencia y valora la mentalidad emprendedora como estrategia para mejorar su calidad de vida, la de su familia e impactar positivamente su entorno lejano y cercano.","DISCUSIÓN DIRIGIDA:Consiste en discutir un tema, bajo la dirección del educador. Su principal uso consiste en dirigir el diálogo mediante preguntas específicas hacia un objetivo común. Después de la discusión se aceptarán las conclusiones de la mayoría por medio de un trabajo de colaboración intelectual.","Entiende la caracterización económica y social del entorno inmediato. Identifica su manera de vivenciar dicha caracterización económica y social de su entorno inmediato. Analiza el mercado laboral y empleabilidad a nivel regional y nacional. Realiza una caracterización de sus aptitudes, habilidades y competencias que le permitan proyectarse como representante de grupo, contralor(a) y personero(a). Emprende la caracterización de señales de riesgo en la institución educativa.","","     guía, cuaderno, tablero","Los estudiantes  diferencia conceptos relacionados con el trabajo pero con eventos reales de su contexto","Comparar conceptos de emprendimiento relacionados con el trabajo  ","Conceptos clave de emprendimiento");
INSERT INTO `planeador_vallesol` VALUES("51","2025-03-02","2025-02-28","2025-02-28","10","15","1","2","Comprende que el reposo o el movimiento rectilíneo uniforme ocurre cuando las fuerzas aplicadas sobre el sistema se anulan entre sí, y que en presencia de fuerzas resultantes no nulas se producen cambios de velocidad. Predice el equilibrio de un cuerpo a partir del análisis de las fuerzas (primera ley de Newton). Estima cambios de velocidad mediante la relación entre fuerza y masa (segunda ley de Newton). Identifica las fuerzas de acción y reacción en diferentes situaciones de interacción (tercera ley de Newton). Evalúa prototipos sobre tipos de movimiento y analiza estructuras con posibles riesgos.","DISCUSIÓN DIRIGIDA:Consiste en discutir un tema, bajo la dirección del educador. Su principal uso consiste en dirigir el diálogo mediante preguntas específicas hacia un objetivo común. Después de la discusión se aceptarán las conclusiones de la mayoría por medio de un trabajo de colaboración intelectual.","Predice el equilibrio de un cuerpo aplicando la primera ley de Newton. Calcula la aceleración usando la segunda ley de Newton. Identifica pares de acción y reacción en situaciones cotidianas. Evalúa prototipos experimentales sobre el movimiento. Analiza el diseño de viviendas o estructuras considerando estabilidad y seguridad.","","     taller, cuaderno ","Es un tema interesante para los estudiantes ya que implica retar su conocimiento en aplicaciones de situaciones cotidianas","Practicar el calculo de fuerzas teniendo en cuenta su sentido y dirección","Fuerza y movimiento: Leyes de Newton");
INSERT INTO `planeador_vallesol` VALUES("52","2025-03-02","2025-02-28","2025-02-28","6","7","1","1","Aporta en la negociación y resolución de conflictos mediante la identificación de valores humanos, la aplicación de derechos y deberes, y la promoción del bienestar colectivo.","TALLER:Implica como su nombre lo dice, un lugar donde se trabaja y labora. Es una forma de enseñar y aprender mediante la realización de algo, es decir aprender haciendo. En esta estrategia predomina y se privilegia, el aprendizaje sobre la enseñanza. Se trata entonces de aprender haciendo, desarrollando habilidades donde los conocimientos se adquieren a través de una práctica concreta; ejecutando algo relacionado con el objetivo que se pretende alcanzar, en un contexto particular de aprendizaje. Es una metodología participativa en la que se enseña y se aprende a través de una tarea conjunta. Su metodología descansa en la actividad del estudiante y en la organización basada en pequeños grupos. La utilización de este método tiene como cometido dar respuesta a preguntas planteadas en las consignas de trabajo, teniendo en cuenta la opinión de todos los miembros del grupo, para llegar a una toma de decisiones colectiva. Desarrollando el taller en la práctica de conocimientos para despertar el interés en los estud","Identifica la importancia de los valores humanos. Conoce los beneficios de una persona comprometida con el bienestar común. Describe cómo aplicar derechos y deberes para convivir en paz. Analiza las ventajas de conocer y aplicar valores humanos. Opina sobre problemas de convivencia y propone soluciones.","","     Guía de trabajo, Cuaderno ","Se debe poner en práctica fuera del aula ya que los estudiantes mientras trabajan en el taller lo ponen en práctica pero luego lo olvidan","Fomentar la reflexión y práctica de normas de urbanidad en situaciones cotidianas","Resolución de conflictos y construcción de paz");
INSERT INTO `planeador_vallesol` VALUES("53","2025-03-02","2025-02-28","2025-02-28","9","7","1","1","Aporta en la negociación y resolución de conflictos mediante la identificación de valores humanos, la aplicación de derechos y deberes, y la promoción del bienestar colectivo.","TALLER:Implica como su nombre lo dice, un lugar donde se trabaja y labora. Es una forma de enseñar y aprender mediante la realización de algo, es decir aprender haciendo. En esta estrategia predomina y se privilegia, el aprendizaje sobre la enseñanza. Se trata entonces de aprender haciendo, desarrollando habilidades donde los conocimientos se adquieren a través de una práctica concreta; ejecutando algo relacionado con el objetivo que se pretende alcanzar, en un contexto particular de aprendizaje. Es una metodología participativa en la que se enseña y se aprende a través de una tarea conjunta. Su metodología descansa en la actividad del estudiante y en la organización basada en pequeños grupos. La utilización de este método tiene como cometido dar respuesta a preguntas planteadas en las consignas de trabajo, teniendo en cuenta la opinión de todos los miembros del grupo, para llegar a una toma de decisiones colectiva. Desarrollando el taller en la práctica de conocimientos para despertar el interés en los estud","Identifica la importancia de los valores humanos. Conoce los beneficios de una persona comprometida con el bienestar común. Describe cómo aplicar derechos y deberes para convivir en paz. Analiza las ventajas de conocer y aplicar valores humanos. Opina sobre problemas de convivencia y propone soluciones.","","     Guía de trabajo, Cuaderno ","Se debe poner en práctica fuera del aula ya que los estudiantes mientras trabajan en el taller lo ponen en práctica pero luego lo olvidan","Fomentar la reflexión y práctica de normas de urbanidad en situaciones cotidianas","Resolución de conflictos y construcción de paz");
INSERT INTO `planeador_vallesol` VALUES("54","2025-03-02","2025-03-21","2025-02-28","6","3","1","6","• Analiza como en las sociedades antiguas surgieron las primeras ciudades y el papel de la agricultura y el comercio para la expansión de estas.• Analiza las distintas formas de gobierno ejercidas en la antigüedad y las compara con el ejercicio del poder político en el mundo contemporáneo.• Analiza cómo en el escenario político democrático entran en juego intereses desde diferentes sectores sociales, políticos y económicos, los cuales deben ser dirimidos por los ciudadanos.","presentación a través de documento sobre los conceptos básicos de windows:","• Relaciona el origen de la agricultura con el desarrollo de las sociedades antiguas y la aparición de elementos que permanecen en la actualidad (canales de riego, la escritura, el ladrillo).• Explica el papel de los ríos Nilo, Tigris, Éufrates, Indo, Ganges, Huang He y Yangtsé Kiang, en la construcción de las primeras ciudades y el origen de las civilizaciones antiguas y los ubica en un mapa actual de África y Asia.• Describe semejanzas y diferencias que se observan entre la democracia ateniense y las democracias actuales, en especial la colombiana, para señalar fortalezas, debilidades y alternativas que conduzcan a una mayor democratización.• Describe el origen de la ciudadanía, los cambios que ha tenido en el tiempo y su significado actual.• Argumenta la importancia de participar activamente en la toma de decisiones para el bienestar colectivo en la sociedad, en el contexto de una democracia.• Participa activamente en la construcción de los protocolos de seguridad de la Institución Educativa.","","     Guía de trabajo, Cuaderno ","El trabajo colaborativo facilita la comprensión de conocimientos","Fomentar la reflexión y práctica de normas de urbanidad en situaciones cotidianas","Democracia, Gobierno escolar, Legado cultural, social, económico");
