INSERT INTO `seguimiento` VALUES("231","1085272503","","","TransformaciÔö£Ôöén digital",NULL,"2020-11-02","diseÔö£├óÔö¼ÔûÆo de base de datos","<p>Se recomienda implementar un c&oacute;digo &uacute;nico para las sedes que permitan su f&aacute;cil identificaci&oacute;n</p>\n\n\n\n<p><img src=\"https://educatec.com.co/guagua/reportes/cursos/anotaciones/Anotaci%c3%b3n%202020-11-02%20161603.png\" /></p>\n\n\n\n<ul>\n\n	<li>Se sugiere dividir esta tabla en 2, una tabla de vendedor y otra de cliente</li>\n\n</ul>\n\n\n\n<p><img src=\"https://educatec.com.co/guagua/reportes/cursos/anotaciones/2.png\" /></p>\n\n\n\n<p>Una sugerencia es colocar de primero la llave primaria o &uacute;nica de cada tabka</p>\n\n\n\n<p><img src=\"https://educatec.com.co/guagua/reportes/cursos/anotaciones/3.png\" /></p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>&nbsp;</p>\n\n","si","2020-11-02","14:46:00","16:46:00","1085290375","","65 ");
INSERT INTO `seguimiento` VALUES("232","1085269012","","","",NULL,"2020-11-02","","<p>Se recomienda realizar una asignaci&oacute;n de llave primaria a la tabla citas</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p><img src=\"https://educatec.com.co/guagua/reportes/cursos/anotaciones/5.png\" /></p>\n\n\n\n<p>&nbsp;Como lo observamos en clase esta bien lo que se realizo pero si se quiere optimizar la base de datos se puede resumir en una tabla de persona junto a m&eacute;dicos y pacientes</p>\n\n\n\n<p>&nbsp;</p>\n\n","si","2020-11-02","16:36:00","18:36:00","1085290375","","65 ");
