INSERT INTO `seguimiento` VALUES("283","59311894","","si","hst","10:00:00","2021-03-04","tÔö£├óÔö¼┬«cnicas de digitaciÔö£├óÔö¼Ôöén","Teniendo en cuenta que la anterior sessiÔö£Ôöén se realizo una prueba libre con un software de digitaciÔö£Ôöén con el fin que Jackeline pueda adapartse a la herramienta, el dÔö£┬ía de hoy se opta por desarrollar una actividad en la que se lleva registro de las 10 lecciones que tiene el programa con el fin contrastar con los resultados de estudiantes que presentan el mismo nivel de la estudiante con el objetivo de identificar y fortalecer sus habilidades.Se observa que se debe realizar una mayor ejercitaciÔö£Ôöén en el uso del mouse con herramientas que brinda el docente para que su desempeÔö£ÔûÆo en el ordenador mejore.","si","2021-03-04","10:00:00","00:20:00","1085290375",NULL,"75");
INSERT INTO `seguimiento` VALUES("284","59311894","","si","hst","10:00:00","2021-03-02","tecnicas de digitaciÔö£├óÔö¼Ôöén","<p>Se realiza un diganostico de los conceptos, habilidades y contexto de la estudiante mediante el uso de software de digitaci&oacute;n y uso de mouse junto a digalogo quer permite identificar que es necesario <strong>fortalecer</strong> el uso de mouse, teclado y su motricidad fina.</p>","si","2021-03-02","10:00:00","12:00:00","1085290375",NULL,"75");
INSERT INTO `seguimiento` VALUES("285","59311894","","SI","hst","08:00:00","2021-03-06","carpetas","<p>Se evidencia una mejora en el uso de t&eacute;cnicas de digitaci&oacute;n y una mejora en el uso de mouse. En esta clase se busca fortalecer el uso de teclado mediante el uso de atajos de tecldo los cuales permiten ahorrar tiempo en el desarrollo de sus actividades, no implica descartar el uso del mouse totalmente sino usarlo cuando es necesesario y de forma adecuada. Se procede a explicar el uso de estructura de carpetas mediante el uso del cuadernillo de ejercicios que sirve de apoyo para su proceso de aprendizaje. La recomendaci&oacute;n es practicar de forma frecuente con el fin de fortalecer y afianzar conceptos.</p>\n\n<p>Se adjunta enlace con gr&aacute;fica que presenta una gr&aacute;fico de barra de rendimiento&nbsp; de digitaci&oacute;n en comparaci&oacute;n a otros estudiantes en el cual un mayor tama&ntilde;o de la barra representa un mejor desempe&ntilde;o&nbsp; https://drive.google.com/file/d/18e9oZ6BryUg5Nk_vNTQlAzthAclM-oJE/view?usp=sharing</p>","SI","2021-03-06","08:00:00","10:00:00","1085290375",NULL,"75");
INSERT INTO `seguimiento` VALUES("286","59311894","","si","hst","11:32:00","2021-03-09","docuemtno de texto","<p>Se evidencia el compromiso de la estudiante ya que se pudo observar el repaso que ha venido realizando en cuanto a digitaci&oacute;n y administraci&oacute;n de carpetas. En la sesi&oacute;n del d&iacute;a de hoy se articulo con la creaci&oacute;n de documentos que permita generar organigramas empresariales y organizaci&oacute;n de informaci&oacute;n. Como recomendaci&oacute;n se realiza la sugerencia de seguir instrucciones de los docuementos o lo solicitado para evitar resultados incorrectos.</p>","si","2021-03-09","11:32:00","13:32:00","1085290375",NULL,"75");
INSERT INTO `seguimiento` VALUES("287","59311894","","si","hst","22:00:00","2021-03-18","estructura de carpetas","<p>Se produndiza sobre el concepto de la estructura de carpetas y se&nbsp; plantea una actividad para fortalecer ese fundamento. Es fundamental la concentraci&oacute;n&nbsp; en las clases para obtener mejores resultados.</p>","si","2021-03-18","22:00:00","12:34:00","1085290375",NULL,"75");
INSERT INTO `seguimiento` VALUES("288","n/a306166448","","si","hst","21:46:00","2021-04-09"," fundamentos de windows","<p>Se realiza un diganostico con la estudiante en el cual se evidencia la necesidad de iniciar desde cero para facilitar su proceso de aprendizaje.&nbsp; En esta sesi&oacute;n se brinda fundamentos sobre caracteristicas y componentes escenciales del ordenador que permitan diferenciar y realizar una selecci&oacute;n de computador de acuerdo a las necesidades de cada persona.&nbsp;</p>","si","2021-04-09","21:46:00","21:46:00","1085290375",NULL,"78");
