INSERT INTO `seguimiento` VALUES("298","n/a1320983015","","si","hst","15:36:00","2021-05-20","InformÔö£├óÔö¼├¡tica BÔö£├óÔö¼├¡sica","<p>Se evidencia en la estudiante conocimientos previos en inform&aacute;tica b&aacute;sica que con el proceso de capacitaci&oacute;n se fortalecen pero qu&eacute; si es indispensable un proceso autonomo de pr&aacute;ctica&nbsp; por parte de la estudiante para mantener y mejorar dichas habilidades.</p>","si","2021-05-20","15:36:00","17:36:00","1085290375",NULL,"79");
INSERT INTO `seguimiento` VALUES("299","n/a1320983015","","si","hst","15:56:00","2021-05-20","ofimÔö£├óÔö¼├¡tica","<p>Teniendo en cuenta que es un curso intensivo y la cantidad de horas se realiza presentaci&oacute;n de algunos de los items a rescatar del plan de capacitaci&oacute;n y se recomienda para generar maestria intensificar la practica fuera del aula de clase.</p>","si","2021-05-20","15:56:00","17:56:00","1085290375",NULL,"79");
INSERT INTO `seguimiento` VALUES("300","1085322032","","si","AnÔö£├¡lisis de datos","19:42:00","2021-07-07","DiseÔö£ÔûÆo de base de datos","<p>Jessica los campos en la tabla cita como nombres y apellidos y especialidad&nbsp; son inncesearios&nbsp; y es mejor remplazarlos unicamente por la identificaci&oacute;n del doctor en la tabla cita ya que perfectamente podemos buscar todos los datos personales del doc en la tabla medicos con su identificaci&oacute;n o un join en sql. Lo mismo sucede con el campo eps&nbsp; ya que con el numero de identificaci&oacute;n del paciente podemos consultar todos los datos personales en la tabla paciente.</p>\n\n<p>&nbsp;</p>","si","2021-07-07","19:42:00","21:42:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("301","1085323649","","si","AnÔö£├¡lisis de datos","20:59:00","2021-07-07","DiseÔö£ÔûÆo de base de datos ","<p>Angie, muy interesante propuesta de dise&ntilde;o de base de datos; no olvides que lo que plasmas en el dise&ntilde;o de base de datos debe tener coherencia con la ejecuci&oacute;n en el sistema de gesti&oacute;n de base de datos , es decir verifica que los campos que estableciste en el dise&ntilde;o deben estar en ejecuci&oacute;n&nbsp;</p>\n\n<p>&nbsp;</p>","si","2021-07-07","20:59:00","22:59:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("302","1085257374","","si","","21:11:00","2021-07-07","","<p>Dayana puedo sugerir que el campo de duraci&oacute;n de la cita lo puedes quitar ya que en el informe o la consulta podemos obtenerlo meduante la resta de fecha-hora de finalizaci&oacute;n y la fecha-hora de inicio&nbsp;</p>\n\n<p><img src=\"data:image/png;base64,\" alt=\"\" /></p>","si","2021-07-07","21:11:00","23:11:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("303","1089078219","","si","AnÔö£├¡lisis de datos","21:22:00","2021-07-07","DiseÔö£ÔûÆo de base de datos","<p>Stiven tiene una buena estructura de base de datos pero&nbsp; puedo sugerir que considere mover aribag,aire acondicionado&nbsp; y pintura metalizada a una tabla llamada \"modelo\" ya que generalmente muchos carros del inventario suelen tener las mismas caracteristicas de un modelo y seria inncesario.&nbsp;</p>\n\n<p>el n&uacute;mero de factura es innecesario en la tabla cliente ya que si un cliente genera varias facturas se van a repisar sobre es campo y solo podremos guardar una, raz&oacute;n por la cual para un mejor control se queda solamente en la tabla ventas.</p>\n\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"560\" height=\"137\" /></p>\n\n<p>&nbsp;</p>","si","2021-07-07","21:22:00","23:22:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("304","30738425","","si","AnÔö£├¡lisis de datos","21:38:00","2021-07-07","DiseÔö£ÔûÆo de base de datos","<p>Carlota buen dise&ntilde;o de base de datos, no comprendo la referencia a titular_medico y sustituto_medico. si haces referencia al \"remplazo\" del doctor deberia exisitr una tabla con los datos de los sustitutos ya que si deseamos conocer m&aacute;s datos sobre ellos no lo podriamos hacer.</p>\n\n<p><img src=\"data:image/png;base64,\" alt=\"\" /></p>","si","2021-07-07","21:38:00","23:38:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("305","1085334317","","si","AnÔö£├¡lisis de datos","21:55:00","2021-07-07","DiseÔö£ÔûÆo de base de datos","<p>Daniela buen dise&ntilde;o de base de datos, no debes olvidar que para el correo electronico de los usuarios no unicamente existe gmail, es mejor usar correo.</p>\n\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"714\" height=\"88\" /></p>","si","2021-07-07","21:55:00","23:55:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("306","93127252","","si","AnÔö£├¡lisis de datos","17:35:00","2021-07-08","DiseÔö£ÔûÆo de base de datos","<p>Henry buen dise&ntilde;o de base de datos, le invito a cuestionarse que tan pertinente considerar crear una tablapersona que resuma los datos que se repiten en cliente y procurador para posteriormente llevar el id de la persona a la tabla cliente y procurador, pi&eacute;nsalo.</p>\n\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"622\" height=\"128\" /></p>","si","2021-07-08","17:35:00","19:35:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("307","87248033","","si","AnÔö£├¡lisis de datos","17:45:00","2021-07-08","DiseÔö£ÔûÆo de base de datos","<p>&nbsp;</p>\n\n<p>Jhon, hace falta una tabla independiente de citas; que no se encuentra en la tabla doctor ya que son datos independientes revisala por favor</p>\n\n<p><img src=\"data:image/png;base64,\" alt=\"\" /></p>","si","2021-07-08","17:45:00","19:45:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("308","52259712","","si","AnÔö£├¡lisis de datos","17:49:00","2021-07-08","diseÔö£ÔûÆo de base de datos","<p>Julia&nbsp; recomiendo usar gui&oacute;n al piso para unir palabras para el dise&ntilde;o de base de datos y tener cuidado con colocar la identificaci&oacute;n el paciente en el doctor porque esto genera que el doctor solo pueda revisar a un solo paciente mientras que colocar el c&oacute;digo el doctor y paciente en cita genera que se puedan hacer varias citas para paciente y doctor.</p>\n\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"527\" height=\"189\" /></p>","si","2021-07-08","17:49:00","19:49:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("309","5268865","","si","AnÔö£├¡lisis de datos","17:03:00","2021-07-09","DiseÔö£ÔûÆo de base de datos","<p>Leonardo sugiero que el num_expediente&nbsp; en la tabla cliente sobra ya que lo tienes en estado y lo que podrias hacer es llevar la CC de la tabla cliente a la tabla estado y recuerda que el conjunto de tablas es una base de datos.</p>\n\n<p><img src=\"data:image/png;base64,\" alt=\"\" /></p>","si","2021-07-09","17:03:00","19:03:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("310","127529421","","si","AnÔö£├¡lisis de datos","17:13:00","2021-07-09","DiseÔö£ÔûÆo de base de datos","<p>Mauricio cuentas con buen dise&ntilde;o de base de datos pero&nbsp; ten cuidado que los nombres entre palabras de los campos no contengan espacios</p>\n\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"660\" height=\"216\" /></p>","si","2021-07-09","17:13:00","19:13:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("311","1127812501","","si","AnÔö£├¡lisis de datos","17:16:00","2021-07-09","DiseÔö£ÔûÆo de base de datos","<p>Carolina un buen dise&ntilde;o de base de datos pero ten cuidado que se encuentra duplicado la id_cliente en la tabla citas lo cual seria un espacio no necesario en la base de datos y para posteior an&aacute;lisis recomiendo en lugar de cumplimiento de la cita asignar fecha de finalizaci&oacute;n de la cita para tener metricas de tiempo asi verificar el cumplimiento de la cita&nbsp;</p>\n\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"526\" height=\"212\" /></p>","si","2021-07-09","17:16:00","19:16:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("312","27088637","","si","AnÔö£├¡lisis de datos","17:19:00","2021-07-09","DiseÔö£ÔûÆo de base de datos","<p>Doris brinda cumplimiento a los solicitado, la sugerencia es complementar m&aacute;s datos para poder complementar lo realizado por el docente en clase</p>\n\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"576\" height=\"109\" /></p>","si","2021-07-09","17:19:00","19:19:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("313","1144065763","","si","AnÔö£├¡lisis de datos","17:21:00","2021-07-09","DiseÔö£ÔûÆo de base de datos","<p>Sebastian buena propuesta de dise&ntilde;o de base de datos puedo sugerir que el campo planta/sustituto se podria reemplazar por tipo_contrato o similares y no olvidar que los nombres de los campos deben ir sin espacios&nbsp;</p>\n\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"214\" height=\"221\" /></p>","si","2021-07-09","17:21:00","19:21:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("314","1130597621","","si","AnÔö£├¡lisis de datos","17:24:00","2021-07-09","DiseÔö£ÔûÆo de base de datos","<p>Alejandro buen dise&ntilde;o de base de datos, puedo sugerir no olvidar que los nombres de los campos no contengan espacios o n&uacute;mero como en el caso de la tabla asunto con el c&oacute;digo del procurados&nbsp;</p>\n\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"655\" height=\"123\" /></p>","si","2021-07-09","17:24:00","19:24:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("315","1085323649","","si","hst","08:50:00","2021-08-02","consultas sql","<p class=\"MsoNormal\"><span style=\"font-size: 10pt; line-height: 14.2667px; font-family: Arial, sans-serif;\">Select id_vendedores,modo_pago,id_cliente from ventas order by asc limit 3</span></p>\n\n<p>Angie hace flata el campo por el cual quieres ordenar despues de order by</p>\n\n<p>Select id_estudiante,fecha_nacimiento&gt;=&rdquo;1990/01/01&rdquo; and fecha_nacimiento &lt;&rdquo;1994/01/01&nbsp;</p>\n\n<p>Hace falta la comilla antes de cerrar</p>\n\n<p>Select distng profesi&oacute;n from ventas inner join cliente on ventas.id_cliente=cliente.id_cliente where modo_pago=&rdquo;contado&rdquo;</p>\n\n<p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"font-size: 13.3333px;\">La funci&oacute;n es distinct y sugiero usar&nbsp; el campo profesi&oacute;n sin tilde</span></span></p>\n\n<p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"font-size: 13.3333px;\">Select MAX tiempo_promedio_segundos,MIN tiempo_promedio_segundos from sitio_web inner join venta on sitio_web.id_cliente=venta.id_cliente order by valor desc limit 1</span></span></p>\n\n<p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"font-size: 13.3333px;\">La funci&oacute;n max debe contener al campo con parentesis&nbsp;&nbsp;</span></span><span style=\"font-family: Arial, sans-serif;\"><span style=\"font-size: 13.3333px;\">MAX(tiempo_promedio_segundos)</span></span></p>","si","2021-08-02","08:50:00","10:50:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("316","1085257374","","si","hst","08:58:00","2021-08-02","consultas sql","<p>Select modo_pago, id_cliente, valor FROM venta ORDER BY desc LIMIT 5</p>\n\n<p>Hace falta&nbsp; el campo por el cual se desea ordenar despues de order by&nbsp;</p>\n\n<p>&nbsp;Select id_vendedor, modo_pago, valor FROM venta ORDER BY asc LIMIT 3</p>\n\n<p>Hace falta&nbsp; el campo por el cual se desea ordenar despues de order by&nbsp;</p>\n\n<p>Select dispositivo, id_cliente, FROM sitio web where tiempo_promedio_segundos&lt;&rdquo;60&rdquo;</p>\n\n<p>despues de id_cliente la coma sobra ya que no hay otro campo que mostrar&nbsp; la tabla es sitio_web&nbsp;</p>\n\n<p>Select distinct profesion FROM cliente inner join venta on cliente.id_cliente = venta.id_cliente where modo_pago =\"contado\"</p>\n\n<p>Recoirdar que la tabla es venta y en el join presenta a ventas</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>","si","2021-08-02","08:58:00","10:58:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("317","1089078219","","si","hst","09:17:00","2021-08-02","consultas sql","<p>select modo_pago, id_cliente, valor from venta order by desc limit 5</p>\n\n<p>&nbsp;</p>\n\n<p>hace falta el campo por el cual se quiere ordenar despues de order by</p>\n\n<p>&nbsp;</p>\n\n<p>select id_vendedor, modo_pago, valor from venta order by asc limit 3</p>\n\n<p>&nbsp;</p>\n\n<p>hace falta el campo por el cual se quiere ordenar despues de order by</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;select id_persona, genero, fecha_nacimiento fom persona where correo = &ldquo;&rdquo; or telefono_persona = &ldquo;&rdquo;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>la palabra correcta es from&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>select profesion from cliente inner join venta on cliente. id_cliente = venta. id_cliente order valor desc limit 3</p>\n\n<p>&nbsp;</p>\n\n<p>recordar que se debe usar order by&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>select max tiempo_promedio_segundos, min tiempo_promedio_segundos from sitio_web inner join venta on sitio_web. id_cliente = venta. id_cliente order by valor desc milit 1</p>\n\n<p>&nbsp;</p>\n\n<p>Recordar que las funciones min y max, los campos deben ir con parentesis max(campo) y la palabra es limit&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>select max tiempo_promedio_segundos from sitio_web inner join cliente on sitio_web. id_cliente = cliente. id_cliente inner join persona on cliente. id_persona = persona. id_persona where telefono_persona = &ldquo;&rdquo;</p>\n\n<p>&nbsp;</p>\n\n<p>Recordar que las funciones min y max, los campos deben ir con parentesis max(campo) y la palabra es limit&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>select id_sede, id_vendedor from vendedor inner join venta on&nbsp; id_vendedor = id_vendedor where modo_pago = &ldquo;credito&rdquo;</p>\n\n<p>&nbsp;</p>\n\n<p>Cuando se realiza un join depues de select es bueno usar nombre_tabla.campo ejemplo vendedor.id_vendedor</p>","si","2021-08-02","09:17:00","11:17:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("318","1085334317","","si","hst","09:24:00","2021-08-02","consultas sql","<p>-&nbsp; &nbsp; &nbsp; &nbsp; Select&nbsp; modo_ de pago ,id_ cliente , valor&nbsp; from venta&nbsp; order by desc LIMIT 5</p>\n\n<p>&nbsp;</p>\n\n<p>hace falta el campo despues de order by&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>-&nbsp; &nbsp; &nbsp; &nbsp; Select id_vendedor, modo_pago,valor from venta order by asc LIMIT3&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;hace falta el campo despues de order by&nbsp;</p>\n\n<p>-<span style=\"white-space: pre;\"> </span>Select id_persona, genero, fecha_nacimiento from persona where correo (=&rdquo;&rdquo;&rdquo;&rdquo;)</p>\n\n<p>debes tener ciudado con la cantidad de comillas al final&nbsp;</p>\n\n<p>-<span style=\"white-space: pre;\"> </span>Select distinct profesi&oacute;n from ventas inner join cliente on ventas.id_cliente= cliente.id_cliente where modo_pago =&rdquo;contado&rdquo;</p>\n\n<p>Tener cuidado con los acentos para los campos y recordar que la tabla se llama venta</p>\n\n<p>select profesi&oacute;n, valor from cliente inner join venta on cliente. Id cliente = venta.id cliente onder by desc LIMIT 3&nbsp;</p>\n\n<p>Hace falta el campo por el cual se ordena en order by&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>","si","2021-08-02","09:24:00","11:24:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("319","93127252","","si","hst","10:15:00","2021-08-02","consultas sql","<p>* Select modo_pago,id_cliente,valor from venta where order by valor desc limit 5</p>\n\n<p>En la consulta para el uso del order by no es necesario el where, si presentara una condici&oacute;n anterior al order by si es necesario el where, de lo contrario no.</p>\n\n<p>* Select id_vendedor,modo_pago,valor from venta where order by valor asc limit 3</p>\n\n<p>En la consulta para el uso del order by no es necesario el where, si presentara una condici&oacute;n anterior al order by si es necesario el where, de lo contrario no.</p>\n\n<p>*Select profesion,valor from cliente inner join venta on cliente.id_cliente = venta.id_cliente where order by valor desc LIMIT 3</p>\n\n<p>En la consulta para el uso del order by no es necesario el where, si presentara una condici&oacute;n anterior al order by si es necesario el where, de lo contrario no.</p>\n\n<p>*Select max tiempo_promedio_segundos, min tiempo_promedio_segundos from sitio_web inner join venta on sitio_web.id_cliente = venta.id_cliente where order by valor desc limit 1</p>\n\n<p>En la consulta para el uso del order by no es necesario el where, si presentara una condici&oacute;n anterior al order by si es necesario el where, de lo contrario no. De igual forma para max y min debemos usar max(tiempo_promedio_segundos)</p>\n\n<p>*select max tiempo_promedio_segundos from sitio_web inner join persona on sitio_web.id_persona = persona.id_persona where tel&eacute;fono_persona is null</p>\n\n<p>En la consulta&nbsp; para max y min debemos usar max(tiempo_promedio_segundos) y wl campo en la tabla sitio web se llama id_cliente</p>\n\n<p>*Select color from carro inner join venta on carro.id_chasis = venta.id_chasis where order by valor desc limit 3</p>\n\n<p>En la consulta para el uso del order by no es necesario el where, si presentara una condici&oacute;n anterior al order by si es necesario el where, de lo contrario no.</p>","si","2021-08-02","10:15:00","12:15:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("320","5268865","","si","hst","10:29:00","2021-08-02","consultas sql","<p>*Select modo_pago, id_cliente, valor from venta order by id_cliente &gt; Max Limit 5</p>\n\n<p>Leonardo &gt; Max sobra y deberia ser reemplazado por desc&nbsp;</p>\n\n<p>*Select Id_vendedor, modo_pago, valor from venta order by asc LIMIT 3</p>\n\n<p>Hace falta el campo por el cual ordenar despues de order by&nbsp;</p>\n\n<p>*Select Id_cliente, profesi&oacute;n from cliente;</p>\n\n<p>tener en en cuenta no usar los acentos para los campos&nbsp;</p>\n\n<p><span style=\"white-space: pre;\">*</span><span style=\"white-space: pre;\">Select profesi&oacute;n=valor from clientes LEFT JOIN venta ON cliente.id cliente=venta.id LIMIT 3</span></p>\n\n<p><span style=\"white-space: pre;\">Se deberia usar , en lugar de igual y tener cuidado con los acentos </span></p>\n\n<p><span style=\"white-space: pre;\">*Select MAX tiempo_promedio_segundos, MIN tiempo_promedio_segundos from sitio_web INNER JOIN venta ON sitio_web.id_cliente = venta.id_cliente ORDER BY valor desc LIMIT 1</span></p>\n\n<p><span style=\"white-space: pre;\">Deberiamos usar </span><span style=\"white-space: pre;\">MAX(tiempo_promedio_segundos)</span></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>","si","2021-08-02","10:29:00","12:29:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("321","1127812501","","si","hst","10:38:00","2021-08-02","consultas sql","<p>*SELECT MAX modo_pago,id_cliente,valor FROM venta ORDER BY valor desc LIMIT 5</p>\n\n<p>Carolina, para usar max deberia ser MAX(modo_pago)</p>\n\n<p>*SELECT id_cliente, dispositivo FROM sitio_web WHERE tiempo_promedio_segundo&lt; \"60\"</p>\n\n<p>Recuerda que el nombre del campo es tiempo_promedio_segundos&nbsp;</p>\n\n<p>*SELECT id_personas,genero,fecha_nacimiento FROM persona WHERE correo =\"\" OR telefono_persona = \"\"</p>\n\n<p>Recuerda que el campo se llama id_persona</p>\n\n<p>*SELECT MAX tiempo_promedio_segundos, MIN tiempo_promedio_segundos FROM sitio_web INNER JOIN venta ON sitio_web.id_cliente = venta.id_cliente ORDER BY valor desc LIMIT 1</p>\n\n<p>Carolina, para usar max deberia ser MAX(modo_pago)</p>\n\n<p>\"SELECT MAX tiempo_promedio_segundos FRO sitio_web INNER JOIN cliente ON sitio_web.id_cliente = cliente.id_cliente WHERE telefono_persona = \"\"</p>\n\n<p>Carolina, para usar max deberia ser MAX(modo_pago)</p>\n\n<p>*SELECT fecha_entrega FROM venta INNER JOIN sitio_web ON sitio_web.id_cliente = venta.id_cliente WHERE dispositivo = \"movil\"</p>","si","2021-08-02","10:38:00","12:38:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("322","27088637","","si","hst","10:48:00","2021-08-02","consultas sql","<p>*Select modo_ pago, id_venta, valor, From venta ORDER BY valor LIMIT 5 DES</p>\n\n<p>Recuerda que al final debe ser DESC</p>\n\n<p>*Select id_ vendedor, modo_pago, valor From venta ORDER BY valor LIMIT 3 ASC</p>\n\n<p>Recuerda que asc va antes de limit&nbsp;</p>\n\n<p>*Select dispositivo id cliente, from sitio_web where tiempo_promedio _segundos &lt; &ldquo;60&rdquo;</p>\n\n<p>Hace una coma antes de id_cliente</p>\n\n<p>*Select MAX (tiempo_promedio_segundos), MIN (tiempo_promedio_segundos), valor&nbsp;</p>\n\n<p>FROM sitio_web INNER JOIN venta on sitio_web.id_cliente=venta.id_cliente ORDER BY&nbsp; 3 desc limit 1</p>\n\n<p>Recuerda que despues del order by va el campo no el n&uacute;mero</p>\n\n<p>Select MAX (tiempo_promedio_segundos) FROM sitio_web INNER JOIN cliente on sitio_web.id_cliente= cliente.id_cliente INNER JOIN persona on cliente.id_persona = persona.id_persona WHERE telefono_persona = &rdquo; &rdquo;</p>","si","2021-08-02","10:48:00","12:48:00","1085290375",NULL,"82");
INSERT INTO `seguimiento` VALUES("323","1130597621","","si","hst","10:58:00","2021-08-02","consultas sql","<p>*Select&nbsp; id_vendedor, modo_pago_valor from venta order by valor asc limit 3</p>\n\n<p>Recuerda que valor es otro campo (modo_pago, valor)</p>\n\n<p>*Select&nbsp; id_persona, genero, fecha_naciomiento from persona&nbsp; where&nbsp; correo = &ldquo;&rdquo; or tel&eacute;fono_persona = &ldquo;&rdquo;&nbsp;</p>\n\n<p>El campo fecha_naciomiento&nbsp; se encuentra mal escrito</p>\n\n<p>*Select distinc profesion from clientes inner join venta on cliente. id_cliente = ventas. id_cliente&nbsp; where modo_pago= &ldquo;contado&rdquo;</p>\n\n<p>la palabra correcta es distinct</p>\n\n<p>*Select max tiempo_promedio_segundos, min tiempo_promedio_segundos from sitio_web inner join venta on sitio_ web.id_cliente = venta.id_cliente order by valor desc limit 1</p>\n\n<p>La funci&oacute;n MAX y MIN&nbsp; debe ir max( tiempo_promedio_segundos)</p>\n\n<p>*Select max tiempo_promedio_segundos from sitio_web inner join persona on sitio_ web.id_cliente = persona.id_cliente where correro = &ldquo;&rdquo;</p>\n\n<p>La funci&oacute;n MAX y MIN&nbsp; debe ir max( tiempo_promedio_segundos)</p>\n\n<p>*Select max tiempo_promedio_segundos, dispositivo from sitio_web inner join venta on sitio_ web.id_cliente = venta.id_cliente order by valor asc limit 5</p>\n\n<p>La funci&oacute;n MAX y MIN&nbsp; debe ir max( tiempo_promedio_segundos)</p>\n\n<p>Select id_sedes&nbsp; from sede inner join venta on sede. Id_sede =&nbsp; venta. Id_sede order by asc limit 3</p>\n\n<p>Hace falta el criterio para ordenar despu&eacute;s de order by&nbsp;</p>","si","2021-08-02","10:58:00","12:58:00","1085290375",NULL,"82");
